INSERT INTO MiningActivityTypeType VALUES('inSituRecovery','in-situ recovery','(a) The in-place dissolution of water-soluble mineral components of an ore deposit by permitting a leaching solution, usually aqueous, to trickle downward through the fractured ore to collection galleries at depth. b) The mining of soluble rock material, esp. salt, from underground deposits by pumping water down wells into contact with the deposit and removing the artificial brine thus created.','http://inspire.ec.europa.eu/codelist/MiningActivityTypeValue/inSituRecovery');
INSERT INTO MiningActivityTypeType VALUES('openPitMining','open pit mining','An open-sky excavation (also open-sky mine) for the extraction of metallic ores and /or commodities.','http://inspire.ec.europa.eu/codelist/MiningActivityTypeValue/openPitMining');
INSERT INTO MiningActivityTypeType VALUES('placerDredging','placer dredging','A form of open pit mining in which the digging machinery and processing plant are situated on a floating barge or hull.','http://inspire.ec.europa.eu/codelist/MiningActivityTypeValue/placerDredging');
INSERT INTO MiningActivityTypeType VALUES('quarrying','quarrying','Open workings, usually for the extraction of stone.','http://inspire.ec.europa.eu/codelist/MiningActivityTypeValue/quarrying');
INSERT INTO MiningActivityTypeType VALUES('subaqueousRemoteOperatedVehicle','subaqueous remote operated vehicle',null,'http://inspire.ec.europa.eu/codelist/MiningActivityTypeValue/subaqueousRemoteOperatedVehicle');
