INSERT INTO MiningActivityTypeType VALUES('subsurfaceMining','subsurface mining',null,'http://inspire.ec.europa.eu/codelist/MiningActivityTypeValue/subsurfaceMining');
INSERT INTO MiningActivityTypeType VALUES('surfaceMining','surface mining','Broad category of mining in which soil and rock overlying the mineral deposit (the overburden) are removed.','http://inspire.ec.europa.eu/codelist/MiningActivityTypeValue/surfaceMining');
INSERT INTO MiningActivityTypeType VALUES('surfacePlacerMining','surface placer mining','Said of a placer formed by the action of running water, as in a stream channel or alluvial fan; also, said of the valuable mineral, e.g. gold or diamond, associated with an alluvial placer.','http://inspire.ec.europa.eu/codelist/MiningActivityTypeValue/surfacePlacerMining');
INSERT INTO MiningActivityTypeType VALUES('undergroundMining','underground mining','An underground excavation for the extraction of mineral deposits, in contrast to surface excavations','http://inspire.ec.europa.eu/codelist/MiningActivityTypeValue/undergroundMining');
INSERT INTO MiningActivityTypeType VALUES('underwaterMining','underwater mining',null,'http://inspire.ec.europa.eu/codelist/MiningActivityTypeValue/underwaterMining');
INSERT INTO CommodityType VALUES('agate','1000.0','100.0','10.0','1.0','t','agate','A variety of chalcedony having variegated colors arranged in stripes, blended in clouds, or showing mosslike forms. Sardonyx is a red-white or rarely red-white-black variant.. - http://www.merriam-webster.com/dictionary/agate; http://www.quartzpage.de/agate.html','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/agate');
INSERT INTO CommodityType VALUES('aggregate','250000000.0','50000000.0','10000000.0','2000000.0','t','aggregate','Broad category for coarse particulate material used in construction, including sand, gravel, crushed stone, slag, recycled concrete and geosynthetic aggregates. - http://en.wikipedia.org/wiki/Construction_aggregate','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/aggregate');
INSERT INTO CommodityType VALUES('alumina',null,null,null,null,null,'alumina','Alumina is a fairly chemically inert and white chemical compound of aluminium and oxygen with the chemical formula Al2O3. It is the most commonly occurring of several aluminium oxides, and specifically identified as aluminium(III) oxide. It may also be called aloxide, aloxite, or alundum depending on particular forms or applications. Used as filler in plastic and cosmetics, as a catalyst. Corundum used as an abrasive is considered and industrial mineral. - http://en.wikipedia.org/wiki/Alumina','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/alumina');
INSERT INTO CommodityType VALUES('aluminium','1000000000.0','100000000.0','10000000.0','1000000.0','t','aluminium','Aluminium is a chemical element in the boron group with symbol Al and atomic number 13. It is a silvery white, soft, ductile metal. Aluminium is the third most abundant element (after oxygen and silicon), and the most abundant metal in the Earth''s crust. It makes up about 8% by weight of the Earth''s solid surface. Aluminium metal is so chemically reactive that native specimens are rare and limited to extreme reducing environments. Instead, it is found combined in over 270 different minerals.The chief ore of aluminium is bauxite. - http://en.wikipedia.org/wiki/Aluminium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/aluminium');
INSERT INTO CommodityType VALUES('aluminosilicate','5000000.0','2000000.0','500000.0','100000.0','t','aluminosilicate','Aluminosilicate minerals are minerals composed of aluminium, silicon, and oxygen, plus countercations. They are a major component of kaolin and other clay minerals.Andalusite, kyanite, and sillimanite are naturally occurring aluminosilicate minerals that have the composition Al2SiO5 - http://en.wikipedia.org/wiki/Aluminosilicate','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/aluminosilicate');
INSERT INTO CommodityType VALUES('alunite','5000000.0','1000000.0','200000.0','10000.0','t','alunite','A trigonal hydrated aluminium potassium, sulfate mineral, KAl3(SO4)2(OH)6 mined for the manufacture of alum. http://www.webmineral.com/data/Alunite.shtml http://en.wikipedia.org/wiki/Alunite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/alunite');
INSERT INTO CommodityType VALUES('amazonite','10.0','1.0','0.1','0.01','t','amazonite','A green variety of microcline feldspar. -  http://en.wikipedia.org/wiki/Amazonite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/amazonite');
INSERT INTO CommodityType VALUES('amber','10.0','5.0','0.5','0.1','t','amber','Amber is fossilized tree resin (not sap), which has been appreciated for its color and natural beauty since Neolithic times. Much valued from antiquity to the present as a gemstone, amber is made into a variety of decorative objects. Amber is used as an ingredient in perfumes, as a healing agent in folk medicine, and as jewelry. - http://en.wikipedia.org/wiki/Amber','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/amber');
INSERT INTO CommodityType VALUES('amethyst','50.0','5.0','0.5','0.1','t','amethyst','Amethyst is a violet variety of quartz often used in jewelry. - http://en.wikipedia.org/wiki/Amethyst','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/amethyst');
INSERT INTO CommodityType VALUES('andalusite','5000000.0','2000000.0','500000.0','100000.0','t','andalusite','Orthorhombic Al2SiO5 aluminium neosilicate mineral occurring in aluminous metamorphic rocks. http://webmineral.com/data/Andalusite.shtml','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/andalusite');
INSERT INTO CommodityType VALUES('anhydrite','500000000.0','50000000.0','5000000.0','500000.0','t','anhydrite','Anhydrite is a relatively common sedimentary mineral that forms massive rock layers. Anhydrite does not form directly, but is the result of the dewatering of the rock forming mineral Gypsum (CaSO4-2H2O). This loss of water produces a reduction in volume of the rock layer and can cause the formation of caverns as the rock shrinks. - http://www.galleries.com/Anhydrite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/anhydrite');
INSERT INTO CommodityType VALUES('anthophyllite','10000000.0','1000000.0','100000.0','10000.0','t','anthophyllite','An orthorhombic magnesium iron inosilicate hydroxide amphibole mineral: Mg2Mg5Si8O22(OH)2, used in asbestos cement, composite flooring, roofing material and for insulation.http://www.webmineral.com/data/Anthophyllite.shtml http://en.wikipedia.org/wiki/Anthophyllite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/anthophyllite');
INSERT INTO CommodityType VALUES('anthracite','10000000000.0','1000000000.0','100000000.0','5000000.0','t','anthracite','Anthracite is a hard, compact variety of mineral coal that has a high luster. It has the highest carbon content, the fewest impurities, and the highest calorific content of all types of coal (compared to bituminous coal and lignite). http://en.wikipedia.org/wiki/Anthracite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/anthracite');
INSERT INTO CommodityType VALUES('antimony','100000.0','25000.0','2000.0','1000.0','t','antimony','Antimony is a chemical element with symbol Sb (from Latin: stibium) and atomic number 51. A lustrous gray metalloid, it is found in nature mainly as the sulfide mineral stibnite (Sb2S3). Antimony compounds have been known since ancient times and were used for cosmetics; metallic antimony was also known, but it was erroneously identified as lead. - http://en.wikipedia.org/wiki/Antimony','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/antimony');
INSERT INTO CommodityType VALUES('apatite',null,null,null,null,null,'apatite','Apatite is a group of calcium phosphate minerals, usually referring to hydroxylapatite, fluorapatite and chlorapatite, named for high concentrations of OH−, F− and Cl− ions, respectively, in the crystal. The formula of the admixture of the four most common endmembers is written as Ca10(PO4)6(OH,F,Cl)2, and the crystal unit cell formulae of the individual minerals are written as Ca10(PO4)6(OH)2, Ca10(PO4)6(F)2 and Ca10(PO4)6(Cl)2. - http://en.wikipedia.org/wiki/Apatite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/apatite');
INSERT INTO CommodityType VALUES('apatiteGemstone','10000000.0','1000000.0','100000.0','10000.0','ct','apatite-gemstone','Apatite is a group of phosphate minerals, usually referring to hydroxylapatite, fluorapatite and chlorapatite, named for high concentrations of OH−, F− and Cl− ions, respectively, in the crystal. The formula of the admixture of the four most common endmembers is written as Ca10(PO4)6(OH,F,Cl)2, and the crystal unit cell formulae of the individual minerals are written as Ca10(PO4)6(OH)2, Ca10(PO4)6(F)2 and Ca10(PO4)6(Cl)2. - http://en.wikipedia.org/wiki/Apatite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/apatiteGemstone');
INSERT INTO CommodityType VALUES('aquamarine','10.0','5.0','0.5','0.1','t','aquamarine','A blue- or turquoise-colored variety of beryl.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/aquamarine');
INSERT INTO CommodityType VALUES('arsenic','200000.0','20000.0','2000.0','200.0','t','arsenic','Arsenic is a chemical element with symbol As and atomic number 33. Arsenic occurs in many minerals, usually in conjunction with sulfur and metals, and also as a pure elemental crystal. Arsenic is a metalloid. It can exist in various allotropes, although only the gray.form has important use in industry. - http://en.wikipedia.org/wiki/Arsenic','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/arsenic');
INSERT INTO CommodityType VALUES('asbestos','10000000.0','1000000.0','100000.0','10000.0','t','asbestos','One of six naturally occurring silicate minerals that occur in long (roughly 1:20 aspect ratio), thin, flexible fibrous crystals. - http://en.wikipedia.org/wiki/Asbestos','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/asbestos');
INSERT INTO CommodityType VALUES('asbestosAmphibole','10000000.0','1000000.0','100000.0','10000.0','t','asbestos-amphibole','Asbestos formed predominantly of amphibole-group minerals, anthophyllite, crocidolite, riebeckite, amosite, tremolite, actinolite.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/asbestosAmphibole');
INSERT INTO CommodityType VALUES('asbestosSerpentine','10000000.0','1000000.0','100000.0','10000.0','t','asbestos-serpentine','Asbestos formed predominantly of serpentine-group minerals (chrysotile)','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/asbestosSerpentine');
INSERT INTO CommodityType VALUES('asphalt',null,null,null,null,null,'asphalt','Asphalt or bitumen is a sticky, black and highly viscous liquid or semi-solid form of petroleum. It may be found in natural deposits or may be a refined product http://en.wikipedia.org/wiki/Asphalt','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/asphalt');
INSERT INTO CommodityType VALUES('barium',null,null,null,null,null,'barium','Barium is a chemical element with symbol Ba and atomic number 56. It is the fifth element in Group 2, a soft silvery metallic alkaline earth metal. Because of its high chemical reactivity barium is never found in nature as a free element. Its hydroxide was known in pre-modern history as baryta; this substance does not occur as a mineral, but can be prepared by heating barium carbonate. - http://en.wikipedia.org/wiki/Barium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/barium');
INSERT INTO CommodityType VALUES('baryte','5000000.0','1000000.0','200000.0','50000.0','t','baryte','An orthorhombic barium sulfate mineral BaSO4 used as a filler or extender, an addition to industrial products, or a weighting agent in petroleum well drilling mud. http://en.wikipedia.org/wiki/Baryte','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/baryte');
INSERT INTO CommodityType VALUES('basalt','100000000.0','20000000.0','5000000.0','1000000.0','t','basalt','Commercial basalt and traprock includes igneous rocks that are too fine grained to be termed “black granite.” This category includes extrusive igneous rocks, such as andesite, basalt, or dacite, and intrusive igneous rocks, such as amphibolites, diabase, diorites, fine-grained gabbros, peridotites and pyroxenites. http://minerals.usgs.gov/minerals/pubs/commodity/stone_dimension/myb1-2007-stond.pdf','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/basalt');
INSERT INTO CommodityType VALUES('baseMetal',null,null,null,null,null,'base metal','In chemistry, the term base metal is used informally to refer to a metal that oxidizes or corrodes relatively easily and reacts variably with diluted hydrochloric acid (HCl) to form hydrogen. Examples include iron, nickel, lead and zinc. Copper is also considered a base metal because it oxidizes relatively easily, although it does not react with HCl. - http://en.wikipedia.org/wiki/Base_metal','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/baseMetal');
INSERT INTO CommodityType VALUES('bauxite','1000000000.0','100000000.0','10000000.0','1000000.0','t','bauxite','A residual clay deposit, aluminous laterite, derived from the alteration of basalt lava, containing at least 50% Al(OH)3; used as a source of aluminium and as feedstock for ferrous aluminium sulphate water purification material. Used as proppant for hydraulic fracturing; used as abrasive. http://geology.com/minerals/bauxite.shtml','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/bauxite');
INSERT INTO CommodityType VALUES('bentonite','5000000.0','2000000.0','500000.0','100000.0','t','bentonite','Bentonite is an absorbent aluminium phyllosilicate, essentially impure clay consisting mostly of montmorillonite. - http://en.wikipedia.org/wiki/Bentonite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/bentonite');
INSERT INTO CommodityType VALUES('beryl','10.0','1.0','0.1','0.01','t','beryl','Beryl is often unknown to the general public, even the gemstone-buying public. However, it is one of the most important gem minerals. Beryl is colorless in pure form; it is the many different impurities that give beryl its varied coloration. - http://www.galleries.com/Beryl','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/beryl');
INSERT INTO CommodityType VALUES('beryllium','14000.0','1400.0','139.808840758','34.952210189','t','beryllium','Beryllium is the chemical element with the symbol Be and atomic number 4. Because any beryllium synthesized in stars is short-lived, it is a relatively rare element in the universe. It is a divalent element which occurs naturally only in combination with other elements. - http://en.wikipedia.org/wiki/Berylliumin minerals. Notable gemstones which contain beryllium include beryl (aquamarine, emerald) and chrysoberyl. - http://en.wikipedia.org/wiki/Beryllium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/beryllium');
INSERT INTO CommodityType VALUES('bismuth','20000.0','2000.0','200.0','2.0','t','bismuth','Bismuth is a chemical element with symbol Bi and atomic number 83. Bismuth, a pentavalent other metal, chemically resembles arsenic and antimony. Elemental bismuth may occur naturally, although its sulfide and oxide form important commercial ores. - http://en.wikipedia.org/wiki/Bismuth','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/bismuth');
INSERT INTO CommodityType VALUES('blackCoal','10000000000.0','1000000000.0','100000000.0','5000000.0','t','black coal','Bituminous coal or black coal is a moderately hard coal containing higher carbon and fewer impurities than lignite coal but of poorer quality than anthracite. Its coloration can be black or sometimes dark brown; often there are well-defined bands of bright and dull material within the seams. These distinctive sequences, which are classified according to either "dull, bright-banded" or "bright, dull-banded", is how bituminous coals are stratigraphically identified. - http://en.wikipedia.org/wiki/Black_coal','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/blackCoal');
INSERT INTO CommodityType VALUES('borate','25000000.0','2000000.0','100000.0','10000.0','t','borate','Earth material that contains economically significant amounts of minerals containing a borate anion group, one of BO3, B2O5, B3O6, B2O4 , or [B(O,OH)4]. - http://en.wikipedia.org/wiki/Borate_minerals','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/borate');
INSERT INTO CommodityType VALUES('boron',null,null,null,null,null,'boron','Boron is a chemical element with symbol B and atomic number 5. Because boron is produced entirely by cosmic ray spallation and not by stellar nucleosynthesis, it is a low-abundance element in both the solar system and the Earth''s crust. Boron is concentrated on Earth by the water-solubility of its more common naturally occurring compounds, the borate minerals. These are mined industrially as evaporites, such as borax and kernite. - http://en.wikipedia.org/wiki/Boron','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/boron');
INSERT INTO CommodityType VALUES('brickClay','10000000.0','2000000.0','500000.0','100000.0','t','brick clay','End use is determined by the properties of the material therefore it is a valid commodity type','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/brickClay');
INSERT INTO CommodityType VALUES('bromine','1000000.0','100000.0','10000.0','1000.0','t','bromine','Bromine (from Greek: βρῶμος, brómos, meaning "strong-smelling" or "stench")[3] is a chemical element with the symbol Br, and atomic number of 35. It is in the halogen group. -  http://en.wikipedia.org/wiki/Bromine','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/bromine');
INSERT INTO CommodityType VALUES('brownCoal','10000000000.0','1000000000.0','100000000.0','5000000.0','t','brown coal','Lignite, often referred to as sub-bituminous or brown coal, is a soft brown combustible sedimentary rock that is formed from naturally compressed peat. It is considered the lowest rank of coal due to its relatively low heat content. It is mined in Bulgaria, Kosovo, Greece, Germany, Poland, Serbia, Russia, Turkey, the United States, Canada, India, Australia and many other parts of Europe and it is used almost exclusively as a fuel for steam-electric power generation. 25.7% of Germany''s electricity comes from lignite power plants, while in Greece lignite provides about 50% of its power needs. - http://en.wikipedia.org/wiki/Brown_coal','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/brownCoal');
INSERT INTO CommodityType VALUES('cadmium','10000.0','2000.0','500.0','100.0','t','cadmium','Cadmium is a chemical element with the symbol Cd and atomic number 48. This soft, bluish-white metal is chemically similar to the two other stable metals in group 12, zinc and mercury. - http://en.wikipedia.org/wiki/Cadmium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/cadmium');
INSERT INTO CommodityType VALUES('calcite','100000000.0','10000000.0','1000000.0','100000.0','t','calcite','A trigonal calcium carbonate mineral CaCO3 used in large crystal form for optics and as compound additive for soil remediation, soil stabilization and concrete repair. http://www.webmineral.com/data/Calcite.shtml http://en.wikipedia.org/wiki/Calcite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/calcite');
INSERT INTO CommodityType VALUES('carbonaceousMaterial',null,null,null,null,null,'carbonaceous material','Accummulation rich in, or composed of carbon, normally derived from decomposed plant or animal matter. http://en.wikipedia.org/wiki/Carbonaceous','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/carbonaceousMaterial');
INSERT INTO CommodityType VALUES('carnallite','500000000.0','50000000.0','5000000.0','500000.0','t','carnallite','Carnallite is named for Prussian mining engineer, Rudolph von Carnall. It forms in marine evaporite deposits where sea water has been concentrated and exposed to prolonged evaporation.- http://www.galleries.com/Carnallite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/carnallite');
INSERT INTO CommodityType VALUES('carnelian','1000.0','100.0','10.0','1.0','t','carnelian','A variety of chalcedony colored by iron oxide, which is commonly used as a semi-precious gemstone.  The color can vary greatly, ranging from pale orange to an intense almost-black coloration. When Carnelian grades into brown it is known as Sard. Some very dark brown Carnelian can be classified as Jasper.  The distinction between these is very fine and relies more on visual appearance than scientific analysis.  As a result, it is very possible that one man''s Carnelian may be another man''s Sard, Agate or Jasper. - http://en.wikipedia.org/wiki/Carnelian; http://www.controverscial.com/Carnelian.htm','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/carnelian');
INSERT INTO CommodityType VALUES('cassiteriteGemstone',null,null,null,null,null,'cassiterite-gemstone','Cassiterite is a mineral that has ornately faceted specimens with high luster. It is generally opaque, but its luster and multiple crystal faces cause a nice sparkle. -  http://www.galleries.com/Cassiterite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/cassiteriteGemstone');
INSERT INTO CommodityType VALUES('cerium','213000.0','21300.0','2130.0','213.0','t','cerium','Cerium is a chemical element with symbol Ce and atomic number 58. It is a soft, silvery, ductile metal which easily oxidizes in air. - http://en.wikipedia.org/wiki/Cerium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/cerium');
INSERT INTO CommodityType VALUES('cesium','950.0','95.0','10.0','1.0','t','cesium','Caesium or cesium[note 1] is a chemical element with symbol Cs and atomic number 55. It is a soft, silvery-gold alkali metal with a melting point of 28 °C (82 °F), which makes it one of only five elemental metals that are liquid at or near room temperature. - Caesium or cesium[note 1] is a chemical element with symbol Cs and atomic number 55. It is a soft, silvery-gold alkali metal with a melting point of 28 °C (82 °F), which makes it one of only five elemental metals that are liquid at or near room temperature - http://en.wikipedia.org/wiki/Cesium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/cesium');
INSERT INTO CommodityType VALUES('chalcedony','1000.0','100.0','10.0','1.0','t','chalcedony','Chalcedony is a cryptocrystalline form of silica, composed of very fine intergrowths of the minerals quartz and moganite.- http://en.wikipedia.org/wiki/Chalcedony','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/chalcedony');
INSERT INTO CommodityType VALUES('chemicalCompoundProduct',null,null,null,null,null,'chemical compound product','Commodity is a chemical compound that is extracted/processed from an ore material mined from the Earth','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/chemicalCompoundProduct');
INSERT INTO CommodityType VALUES('chemicalOxideProduct',null,null,null,null,null,'chemical oxide product','Commodity is a chemical compound product oxide that is extracted/processed from an ore material mined from the Earth','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/chemicalOxideProduct');
INSERT INTO CommodityType VALUES('chert','250000000.0','50000000.0','10000000.0','2000000.0','t','chert','Chert is a fine-grained silica-rich microcrystalline, cryptocrystalline or microfibrous sedimentary rock that may contain small fossils. It varies greatly in color (from white to black), but most often manifests as gray, brown, grayish brown and light green to rusty red; its color is an expression of trace elements present in the rock, and both red and green are most often related to traces of iron (in its oxidized and reduced forms respectively). - http://en.wikipedia.org/wiki/Chert','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/chert');
INSERT INTO CommodityType VALUES('chlorite','100000.0','20000.0','5000.0','500.0','t','chlorite','The chlorites are a group of phyllosilicate minerals. Chlorites can be described by the following four endmembers based on their chemistry via substitution of the following four elements in the silicate lattice; Mg, Fe, Ni, and Mn. - http://en.wikipedia.org/wiki/Chlorite_group','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/chlorite');
INSERT INTO CommodityType VALUES('chrome','25000000.0','5000000.0','1000000.0','200000.0','t','chrome','A green-colored oxide of chromium, used as a pigment, originally called viridian. http://en.wikipedia.org/wiki/Chromium(III)_oxide','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/chrome');
INSERT INTO CommodityType VALUES('chromite','25000000.0','5000000.0','1000000.0','200000.0','t','chromite','An isometric iron chromium oxide: FeCr2O4 used as a refractory material, because it has a high heat stability. Extracted chromium from chromite is used in chrome plating and alloying for production of corrosion resistant superalloys, nichrome, and stainless steel. Chromium is used as a pigment for glass, glazes, and paint, and as an oxidizing agent for tanning leather. http://www.webmineral.com/data/Chromite.shtml http://en.wikipedia.org/wiki/Chromite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/chromite');
INSERT INTO CommodityType VALUES('chromium',null,null,null,null,null,'chromium','Chromium is a chemical element which has the symbol Cr and atomic number 24. It is the first element in Group 6. It is a steely-gray, lustrous, hard and brittle metal which takes a high polish, resists tarnishing, and has a high melting point. - http://en.wikipedia.org/wiki/Chromium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/chromium');
INSERT INTO CommodityType VALUES('chrysoberyl','10.0','5.0','0.5','0.1','t','chrysoberyl','Chrysoberyl is a poorly known mineral in the gem world even though the gem varieties are popular.There are three main gem varieties: - http://www.galleries.com/Chrysoberyl','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/chrysoberyl');
INSERT INTO CommodityType VALUES('chrysoprase','10.0','1.0','0.1','0.01','t','chrysoprase','A variety of chalcedony that contains small quantities of nickel. Its color is normally apple-green, but varies to deep green. The darker varieties of chrysoprase are also referred to as prase. (However, the term prase is also used to describe chlorite-included quartz, and to a certain extent is a color-descriptor, rather than a rigorously defined mineral variety.) - http://en.wikipedia.org/wiki/Chrysoprase','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/chrysoprase');
INSERT INTO CommodityType VALUES('chrysotile','10000000.0','1000000.0','100000.0','10000.0','t','chrysotile','Monoclinic or orthorhombic Mg3(Si2O5)(OH)4 fibrous asbestos mineral that can be spun and woven into fabric, used in asbestos cement roof sheets ceiling panels and for walls and floors. Chrysotile has been a component in joint compound, some plasters, brake linings, fire barriers, pipe insulation, and gaskets for high temperature equipment. http://www.webmineral.com/data/Chrysotile.shtml http://en.wikipedia.org/wiki/Chrysotile','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/chrysotile');
INSERT INTO CommodityType VALUES('citrine','50.0','5.0','0.5','0.1','t','citrine','Citrine is a variety of quartz whose color ranges from a pale yellow to brown. - http://en.wikipedia.org/wiki/Citrine#Citrine','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/citrine');
INSERT INTO CommodityType VALUES('clay','10000000.0','2000000.0','500000.0','100000.0','t','clay','Deposits mostly composed of microcrystalline phyllosilicate minerals containing variable amounts of water trapped in the mineral structure. - http://en.wikipedia.org/wiki/Clay','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/clay');
INSERT INTO CommodityType VALUES('coal','10000000000.0','1000000000.0','100000000.0','5000000.0','t','coal','Coal is a combustible black or brownish-black sedimentary rock composed primarily of carbon along with variable quantities of other elements, chiefly hydrogen, sulfur, oxygen, and nitrogen, derived from fossilized organic remains. Coal is subdivided in terms of rank. The hardest form or highest rank is anthracite coal, which can be regarded as metamorphic rock because of later exposure to elevated temperature and pressure. Intermediate rank coal is bituminous and low rank coal includes lignite. http://en.wikipedia.org/wiki/Coal','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/coal');
INSERT INTO CommodityType VALUES('coalBedMethane','1000.0','250.0','50.0','10.0','km3','coal bed methane','Coal bed methane (CBM) or coal seam gas (CSG) is a form of natural gas extracted from coal beds. Coal bed methane contains very little heavier hydrocarbons such as propane or butane, and no natural-gas condensate. It often contains up to a few percent carbon dioxide. http://en.wikipedia.org/wiki/Coal_bed_methane','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/coalBedMethane');
INSERT INTO CommodityType VALUES('cobalt','500000.0','50000.0','2000.0','200.0','t','cobalt','Cobalt is a chemical element with symbol Co and atomic number 27. Like nickel, cobalt in the Earth''s crust is found only in chemically combined form, save for small deposits found in alloys of natural meteoric iron. The free element, produced by reductive smelting, is a hard, lustrous, silver-gray metal. - http://en.wikipedia.org/wiki/Cobalt','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/cobalt');
INSERT INTO CommodityType VALUES('copper','10000000.0','1000000.0','100000.0','10000.0','t','copper','Copper is a chemical element with the symbol Cu and atomic number 29. It is a ductile metal with very high thermal and electrical conductivity. Pure copper is soft and malleable; a freshly exposed surface has a reddish-orange color. It is used as a conductor of heat and electricity, a building material, and a constituent of various metal alloys - http://en.wikipedia.org/wiki/Copper','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/copper');
INSERT INTO CommodityType VALUES('cordierite','10000000.0','1000000.0','100000.0','10000.0','ct','cordierite','Cordierite is not a well known or popular mineral for mineral collectors. However, its gemstone variety is well known and is rather popular among gemstone collectors and fanciers. - http://www.galleries.com/Cordierite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/cordierite');
INSERT INTO CommodityType VALUES('corundum','500000.0','100000.0','20000.0','5000.0','t','corundum','Trigonal form of aluminium oxide Al2O3 with exceptional hardness used as an abrasive in sandpaper to machinery. http://www.webmineral.com/data/Corundum.shtml http://en.wikipedia.org/wiki/Corundum','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/corundum');
INSERT INTO CommodityType VALUES('corundumGemstone','10000000.0','1000000.0','100000.0','10000.0','ct','corundum-gemstone','Corundum is the third hardest natural mineral known to science. The hardest mineral, diamond is still four times harder than corundum - http://www.galleries.com/Corundum','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/corundumGemstone');
INSERT INTO CommodityType VALUES('crocidolite','10000000.0','1000000.0','100000.0','10000.0','t','crocidolite','Monoclinic Na2(Fe2+3Fe3+2)Si8O22(OH)2 fibrous form of sodium-rich riebeckite amphibole historically used in filters. http://en.wikipedia.org/wiki/Riebeckite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/crocidolite');
INSERT INTO CommodityType VALUES('crushedRock','250000000.0','50000000.0','10000000.0','2000000.0','t','crushed rock','Deposits quarried from a fresh face and broken by mechanical means into aggregate','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/crushedRock');
INSERT INTO CommodityType VALUES('cryolite','1000000.0','100000.0','10000.0','1000.0','t','cryolite','Monoclinic sodium hexafluoroaluminate  Na3AlF6, used as as a flux to dissolve aluminium from oxide minerals. Natural cryolite is rare so synthetic sodium aluminium fluoride is produced from the fluorite. http://www.webmineral.com/data/Cryolite.shtml http://en.wikipedia.org/wiki/Cryolite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/cryolite');
INSERT INTO CommodityType VALUES('diamond','100000000.0','10000000.0','1000000.0','100000.0','ct','diamond','Cubic carbon allotrope of exceptional hardness used for cutting and grinding. http://www.webmineral.com/data/Diamond.shtml http://en.wikipedia.org/wiki/Diamond','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/diamond');
INSERT INTO CommodityType VALUES('diamondGemstone','100000000.0','10000000.0','1000000.0','100000.0','ct','diamond-gemstone','Diamond is the ultimate gemstone, having few weaknesses and many strengths. It is well known that Diamond is the hardest substance found in nature, but few people realize that Diamond is four times harder than the next hardest natural mineral, corundum (sapphire and ruby). But even as hard as it is, it is not impervious. Diamond has four directions of cleavage, meaning that if it receives a sharp blow in one of these directions it can cleave, or split. - http://www.galleries.com/Diamond','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/diamondGemstone');
INSERT INTO CommodityType VALUES('diatomite','10000000.0','1000000.0','100000.0','10000.0','t','diatomite','''Diatomaceous Earth'' or ''kieselguhr'', fine grained siliceous sediment composed of remains of diatoms (microscopic plants) derived from lacustrine deposits; used as fillers, absorbents, abrasives, an insulator and filter medium in the food industry','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/diatomite');
INSERT INTO CommodityType VALUES('dimensionStone',null,null,null,null,null,'dimension stone','Dimension stone is natural stone or rock that has been selected and fabricated (i.e., trimmed, cut, drilled, ground, or other) to specific sizes or shapes. http://en.wikipedia.org/wiki/Dimension_stone','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/dimensionStone');
INSERT INTO CommodityType VALUES('diopsideEnstatite','10.0','1.0','0.1','0.01','t','diopside-enstatite','Diopside is an important rock forming mineral in several metamorphic and basic to ultra basic igneous rocks, also found in meteorites. Diopside is a part of an important solid solution series of the pyroxene group. Occasionally used as a gemstone and as a mineral specimen. - http://www.galleries.com/Diopside','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/diopsideEnstatite');
INSERT INTO CommodityType VALUES('dioptase','10000000.0','1000000.0','100000.0','10000.0','ct','dioptase','Dioptase is a very beautiful mineral and it is one of the few minerals that can challenge the peerlessness of emerald''s deep green. Unfortunately it is rather soft (for a gemstone) and has good cleavage and therefore is not usually cut as a gemstone. - http://www.galleries.com/Dioptase','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/dioptase');
INSERT INTO CommodityType VALUES('directShippingOre',null,null,null,null,null,'direct shipping ore','Product of mining activity is bulk ore that ships from mine site directly to refinery to extract commodity.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/directShippingOre');
INSERT INTO CommodityType VALUES('directUseCommodity',null,null,null,null,null,'direct use commodity','Commodity mined and used directly as product, in many cases with some sort of ''beneficiation''.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/directUseCommodity');
INSERT INTO CommodityType VALUES('dumortierite','10.0','5.0','0.5','0.1','t','dumortierite','Dumortierite is a boro-silicate mineral that is used as a popular ornamental stone. It has a deep violet to blue color that is very attractive and unusual. Although it is not used as a gemstone due to a lack of clarity, it does have good hardness and a bright color. - http://www.galleries.com/Dumortierite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/dumortierite');
INSERT INTO CommodityType VALUES('dysprosium',null,null,null,null,null,'dysprosium','Dysprosium is a chemical element with the symbol Dy and atomic number 66. It is a rare earth element with a metallic silver luster. - http://en.wikipedia.org/wiki/Dysprosium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/dysprosium');
INSERT INTO CommodityType VALUES('emerald','10000000.0','1000000.0','100000.0','10000.0','ct','emerald','A variety of the mineral beryl characterized by green color.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/emerald');
INSERT INTO CommodityType VALUES('epsomite',null,null,null,null,null,'epsomite','Epsomite, or heptahydrite as it is known in chemistry circles, is one of only a few water soluble sulfate minerals. It is actually well known in most households as the artificially created epsom salt. Magnesium sulfate''s medicinal uses were discovered from mineral waters at Epsom, England from where epsom salt and epsomite get their names. - http://www.galleries.com/Epsomite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/epsomite');
INSERT INTO CommodityType VALUES('erbium',null,null,null,null,null,'erbium','Erbium is a chemical element in the lanthanide series, with the symbol Er and atomic number 68. A silvery-white solid metal when artificially isolated, natural erbium is always found in chemical combination with other elements on Earth. - http://en.wikipedia.org/wiki/Erbium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/erbium');
INSERT INTO CommodityType VALUES('euclase','10000000.0','1000000.0','100000.0','10000.0','ct','euclase','Euclase is not a well known gemstone, but is more well known by mineral collectors. It forms well formed crystals that occasionally have enough clarity to be cut as gems. - http://www.galleries.com/Euclase','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/euclase');
INSERT INTO CommodityType VALUES('europium',null,null,null,null,null,'europium','Europium is a chemical element with the symbol Eu and atomic number 63. It is named after the continent Europe. It is a moderately hard, silvery metal which readily oxidizes in air and water. - http://en.wikipedia.org/wiki/Europium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/europium');
INSERT INTO CommodityType VALUES('evaporite',null,null,null,null,null,'evaporite','Water-soluble mineral sediment or sedimentary rock that results from precipitation of salts concentrated in an an aqueous solution by evaporation or other natural chemical processes.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/evaporite');
INSERT INTO CommodityType VALUES('feldspar','100000000.0','10000000.0','1000000.0','100000.0','t','feldspar','Feldspars (KAlSi3O8 – NaAlSi3O8 – CaAl2Si2O8) are a group of rock-forming tectosilicate minerals that make up as much as 60% of the Earth''s crust. - http://en.wikipedia.org/wiki/Feldspar','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/feldspar');
INSERT INTO CommodityType VALUES('feldsparGemstone','10.0','1.0','0.1','0.01','t','feldspar-gemstone','The feldspars are a group of minerals that have similar characteristics due to a similar structure.- http://www.galleries.com/Feldspar_Group','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/feldsparGemstone');
INSERT INTO CommodityType VALUES('ferrousMetal',null,null,null,null,null,'ferrous metal','Those metals [that are] typically mined for their alloying properties with iron in the manufacture of steel. - AGi fifth ediition','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/ferrousMetal');
INSERT INTO CommodityType VALUES('fluorine',null,null,null,null,null,'fluorine','Fluorine is an extremely reactive and poisonous chemical element with atomic number 9. The lightest halogen and most electronegative element, it exists as a pale yellow diatomic gas at standard conditions. Almost all other elements, including some noble gases, form compounds with fluorine. - http://en.wikipedia.org/wiki/Fluorine','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/fluorine');
INSERT INTO CommodityType VALUES('fluorite','5000000.0','1000000.0','200000.0','50000.0','t','fluorite','Fluorite is a mineral with a veritable bouquet of brilliant colors. Fluorite is well known and prized for its glassy luster and rich variety of colors. The range of common colors for fluorite starting from the hallmark color purple, then blue, green, yellow, colorless, brown, pink, black and reddish orange is amazing and is only rivaled in color range by quartz. - http://www.galleries.com/Fluorite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/fluorite');
INSERT INTO CommodityType VALUES('foundrySand',null,null,null,null,null,'foundry sand','Sand that when moistened or oiled tends to pack well and hold its shape. It is used in the process of sand casting. http://en.wikipedia.org/wiki/Foundry_sand','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/foundrySand');
INSERT INTO CommodityType VALUES('fracSand',null,null,null,null,null,'frac sand','Frac sand is a high-purity quartz sand with very durable and very round grains. It is a crush-resistant material used in the hydraulic fracturing process  to produce petroleum fluids, such as oil, natural gas and natural gas liquids from rock units that lack adequate pore space for these fluids to flow to a well. - http://geology.com/articles/frac-sand/','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/fracSand');
INSERT INTO CommodityType VALUES('FullersEarth','5000000.0','2000000.0','500000.0','100000.0','t','Fullers earth','Clay-rich Earth material that has the capability to decolorize oil or other liquids without chemical treatment. Fuller''s earth typically consists of palygorskite (attapulgite) or bentonite. - http://en.wikipedia.org/wiki/Fuller%27s_earth','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/FullersEarth');
INSERT INTO CommodityType VALUES('gadolinium',null,null,null,null,null,'gadolinium','Gadolinium is a chemical element with symbol Gd and atomic number 64. It is a silvery-white, malleable and ductile rare-earth metal. It is found in nature only in combined (salt) form. - http://en.wikipedia.org/wiki/Gadolinium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/gadolinium');
INSERT INTO CommodityType VALUES('gallium','100.0','50.0','10.0','1.0','t','gallium','Gallium is a chemical element with symbol Ga and atomic number 31. Elemental gallium does not occur in free form in nature, but as the gallium(III) compounds that are in trace amounts in zinc ores and in bauxite. Gallium is a soft silvery metal, and elemental gallium is a brittle solid at low temperatures. - http://en.wikipedia.org/wiki/Gallium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/gallium');
INSERT INTO CommodityType VALUES('garnet','500000.0','100000.0','20000.0','5000.0','t','garnet','Garnets are a group of silicate minerals that have been used since the Bronze Age as gemstones and abrasives. - http://en.wikipedia.org/wiki/Garnet','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/garnet');
INSERT INTO CommodityType VALUES('garnetGemstone','10.0','5.0','0.5','0.1','t','garnet-gemstone','Garnets are a group of silicate minerals that have been used since the Bronze Age as gemstones and abrasives. - http://en.wikipedia.org/wiki/Garnet','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/garnetGemstone');
INSERT INTO CommodityType VALUES('gaseousHydrocarbons','1000.0','250.0','50.0','10.0','km3','gaseous hydrocarbons','Natural gas is a hydrocarbon gas mixture consisting primarily of methane, but commonly includes varying amounts of other higher alkanes and even a lesser percentage of carbon dioxide, nitrogen, and hydrogen sulfide. http://en.wikipedia.org/wiki/Natural_gas','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/gaseousHydrocarbons');
INSERT INTO CommodityType VALUES('gasHydrate','1000.0','250.0','50.0','10.0','km3','gas hydrate','Gas hydrate, is a solid clathrate compound (more specifically, a clathrate hydrate) in which a large amount of methane is trapped within a crystal structure of water, forming a solid similar to ice. Significant deposits of methane clathrate have been found under sediments on the ocean floors of the Earth. http://en.wikipedia.org/wiki/Gas_hydrate','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/gasHydrate');
INSERT INTO CommodityType VALUES('gemstone',null,null,null,null,null,'gemstone','A gemstone or gem (also called a precious or semi-precious stone, a fine gem, or jewel) is a piece of mineral, which, in cut and polished form, is used to make jewelry or other adornments. - http://en.wikipedia.org/wiki/Gemstone','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/gemstone');
INSERT INTO CommodityType VALUES('germanium','500.0','100.0','20.0','5.0','t','germanium','Germanium is a chemical element with symbol Ge and atomic number 32. It is a lustrous, hard, grayish-white metalloid in the carbon group, chemically similar to its group neighbors tin and silicon. Purified germanium is a semiconductor, with an appearance most similar to elemental silicon. Like silicon, germanium naturally reacts and forms complexes with oxygen in nature. Unlike silicon, it is too reactive to be found naturally on Earth in the free (native) state. - http://en.wikipedia.org/wiki/Germanium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/germanium');
INSERT INTO CommodityType VALUES('glauconite',null,null,null,null,null,'glauconite','Glauconite, also known as ''green sand'' is an iron potassium phyllosilicate (mica group) mineral of characteristic green color with very low weathering resistance and very friable.- http://en.wikipedia.org/wiki/Glauconite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/glauconite');
INSERT INTO CommodityType VALUES('gold','500.0','100.0','10.0','1.0','t','gold','Gold is a chemical element with the symbol Au and atomic number 79. It is a dense, soft, malleable and ductile metal with a bright yellow color and luster, the properties of which remain without tarnishing when exposed to air or water. - http://en.wikipedia.org/wiki/Gold','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/gold');
INSERT INTO CommodityType VALUES('granite','100000000.0','20000000.0','5000000.0','1000000.0','t','granite','Commercial granites include all feldspathic crystalline rocks of mainly interlocking texture and with individual mineral grains that are visible to the naked eye. This category includes such rock types as anorthosite, gneiss, granite, granodiorite, monzonite, syenite, and all other intermediate igneous and coarse-grained metamorphic rock types. Primary colors of commercial granites are white, gray, pink, and red; green and brown are secondary colors. Although black granites are also included in this category and range in color from dark gray to black, they are not true granites mineralogically but rather mafic rocks, such as diabases, diorites, gabbros, and similar rocks. http://minerals.usgs.gov/minerals/pubs/commodity/stone_dimension/myb1-2007-stond.pdf','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/granite');
INSERT INTO CommodityType VALUES('graphite','10000000.0','1000000.0','100000.0','10000.0','t','graphite','Graphite is a polymorph of the element carbon. diamond is another polymorph. The two share the same chemistry, carbon, but have very different structures and very different properties. - http://www.galleries.com/Graphite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/graphite');
INSERT INTO CommodityType VALUES('greenstone','100000000.0','20000000.0','5000000.0','1000000.0','t','greenstone','Commercial greenstones are the result of the metamorphosis of basaltic rocks. Greenstone is named because of the predominance of greenish minerals, such as actinolite, chlorite, or epidote. http://minerals.usgs.gov/minerals/pubs/commodity/stone_dimension/myb1-2007-stond.pdf','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/greenstone');
INSERT INTO CommodityType VALUES('gypsum','500000000.0','50000000.0','5000000.0','500000.0','t','gypsum','Gypsum is one of the more common minerals in sedimentary environments. It is a major rock forming mineral that produces massive beds, usually from precipitation out of highly saline waters. Since it forms easily from saline water, gypsum can have many inclusions of other minerals and even trapped bubbles of air and water. - http://www.galleries.com/Gypsum','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/gypsum');
INSERT INTO CommodityType VALUES('hafnium','10000.0','1000.0','100.0','10.0','t','hafnium','Hafnium is a chemical element with the symbol Hf and atomic number 72. A lustrous, silvery gray, tetravalent transition metal, hafnium chemically resembles zirconium and is found in zirconium minerals. - http://en.wikipedia.org/wiki/Hafnium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/hafnium');
INSERT INTO CommodityType VALUES('halloysite',null,null,null,null,null,'halloysite','Halloysite is a 1:1 aluminosilicate clay mineral with the empirical formula Al2Si2O5(OH)4. Its main constituents are aluminium (20.90%), silicon (21.76%) and hydrogen (1.56%). Halloysite typically forms by hydrothermal alteration of alumino-silicate minerals.[4] It can occur intermixed with dickite, kaolinite, montmorillonite and other clay minerals. - http://en.wikipedia.org/wiki/Halloysite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/halloysite');
INSERT INTO CommodityType VALUES('heliodor','10000000.0','1000000.0','100000.0','10000.0','ct','heliodor','Heliodor is the yellow variety of beryl, the "mother of gemstones".  Heliodor does not include golden colors which are given the apt name of golden beryl. - http://www.galleries.com/Heliodor','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/heliodor');
INSERT INTO CommodityType VALUES('hematite',null,null,null,null,null,'hematite','Hematite, also spelled as haematite, is the mineral form of iron(III) oxide (Fe2O3), one of several iron oxides. - http://en.wikipedia.org/wiki/Hematite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/hematite');
INSERT INTO CommodityType VALUES('hematiteGemstone',null,null,null,null,null,'hematite-gemstone','Hematite, also spelled as haematite, is the mineral form of iron(III) oxide (Fe2O3), one of several iron oxides. - http://en.wikipedia.org/wiki/Hematite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/hematiteGemstone');
INSERT INTO CommodityType VALUES('hematiteOre',null,null,null,null,null,'hematite ore','Iron ore in which the iron-bearing mineral is greater that 50% hematite.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/hematiteOre');
INSERT INTO CommodityType VALUES('holmium',null,null,null,null,null,'holmium','Holmium is a chemical element with the symbol Ho and atomic number 67. Part of the lanthanide series, holmium is a rare earth element. - http://en.wikipedia.org/wiki/Holmium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/holmium');
INSERT INTO CommodityType VALUES('HREE','15000000.0','1500000.0','150000.0','15000.0','t','HREE','Heavy Rare Earth Element - See - http://en.wikipedia.org/wiki/Rare_earth_element','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/HREE');
INSERT INTO CommodityType VALUES('HREO',null,null,null,null,null,'HREO','Heavy Rare Earth Oxide - See - http://en.wikipedia.org/wiki/Rare_earth_element','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/HREO');
INSERT INTO CommodityType VALUES('ilmenite','20000000.0','2000000.0','200000.0','20000.0','t','ilmenite','Ilmenite is an economically important and interesting mineral. It is named for its place of discovery (such places are called type localities) at Ilmen Lake in the Ilmen Mountains, Miask in the southern portion of the Ural Mountains of Russia. Ilmenite forms as a primary mineral in mafic igneous rocks and is concentrated into layers by a process called"magmatic segregation".- http://www.galleries.com/Ilmenite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/ilmenite');
INSERT INTO CommodityType VALUES('indium','500.0','100.0','25.0','5.0','t','indium','Indium is a chemical element with symbol In and atomic number 49. This rare, very soft, malleable and easily fusible other heavy metal is chemically similar to gallium and thallium, and shows intermediate properties between these two. - http://en.wikipedia.org/wiki/Indium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/indium');
INSERT INTO CommodityType VALUES('industrialMaterial',null,null,null,null,null,'industrial material','A compound Earth material, or rock product that is directly used for industrial purposes. Not a specific mineral constituent in the mined material.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/industrialMaterial');
INSERT INTO CommodityType VALUES('industrialMineral',null,null,null,null,null,'industrial mineral','Commodity is a mineral or mineral group that is directly used for industrial purposes.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/industrialMineral');
INSERT INTO CommodityType VALUES('industrialRock',null,null,null,null,null,'industrial rock','Different kind of rock types, which are uses for industrial purposes.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/industrialRock');
INSERT INTO CommodityType VALUES('iodine','10000.0','1000.0','100.0','10.0','t','iodine','Iodine is a chemical element with symbol I and atomic number 53. The name is from Greek ἰοειδής ioeidēs, meaning violet or purple, due to the color of elemental iodine vapor. http://en.wikipedia.org/wiki/Iodine','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/iodine');
INSERT INTO CommodityType VALUES('iridium','25.0','5.0','1.0','0.1','t','iridium','Iridium is the chemical element with symbol Ir and atomic number 77. A very hard, brittle, silvery-white transition metal of the platinum family - http://en.wikipedia.org/wiki/Iridium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/iridium');
INSERT INTO CommodityType VALUES('iron','1000000000.0','100000000.0','10000000.0','1000000.0','t','iron','Iron is a chemical element with the symbol Fe and atomic number 26. It is a metal in the first transition series. It is by mass the most common element on Earth, forming much of Earth''s outer and inner core. It is the fourth most common element in the Earth''s crust. - http://en.wikipedia.org/wiki/Iron','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/iron');
INSERT INTO CommodityType VALUES('ironOre',null,null,null,null,null,'iron ore','Iron ores are rocks and minerals from which metallic iron can be economically extracted. The ores are usually rich in iron oxides and vary in color from dark grey, bright yellow, deep purple, to rusty red. The iron itself is usually found in the form of magnetite (Fe3O4), hematite Fe2O3), goethite (FeO(OH)), limonite (FeO(OH).n(H2O)) or siderite (FeCO3). Ores carrying very high quantities of hematite or magnetite (greater than ~60% iron) are known as "natural ore" or "direct shipping ore", meaning they can be fed directly into iron-making blast furnaces. most reserves of such ore have now been depleted. Iron ore is the raw material used to make pig iron, which is one of the main raw materials to make steel. 98% of the mined iron ore is used to make steel. - http://en.wikipedia.org/wiki/Iron_ore','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/ironOre');
INSERT INTO CommodityType VALUES('ironOxide',null,null,null,null,null,'iron oxide','Commodity of interest is any of the sixteen known iron oxides and oxyhydroxides, extracted from the mined material, exclusive of hematite or magnetite produced as an industrial mineral. - http://en.wikipedia.org/wiki/Iron_oxide','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/ironOxide');
INSERT INTO CommodityType VALUES('jade',null,null,null,null,null,'jade','Jade is a name that was applied to ornamental stones that were being brought to Europe from China and Central America.- http://www.galleries.com/Jade','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/jade');
INSERT INTO CommodityType VALUES('jarosite',null,null,null,null,null,'jarosite','Jarosite is a basic hydrous sulfate of potassium and iron with a chemical formula of KFe3+3(OH)6(SO4)2. This sulfate mineral is formed in ore deposits by the oxidation of iron sulfides.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/jarosite');
INSERT INTO CommodityType VALUES('kaolin','50000000.0','10000000.0','2000000.0','500000.0','t','kaolin','Rocks that are rich in kaolinite, a clay mineral with the chemical composition Al2Si2O5(OH)4. Kaolinite is a layered silicate mineral, with one tetrahedral sheet linked through oxygen atoms to one octahedral sheet of alumina octahedra.   http://en.wikipedia.org/wiki/China_clay','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/kaolin');
INSERT INTO CommodityType VALUES('kornerupine','10000000.0','1000000.0','100000.0','10000.0','ct','kornerupine','Kornerupine is a rare gemstone and an equally rare mineral specimen. Its claim to fame is its wonderful emerald green color.- http://www.galleries.com/Kornerupine','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/kornerupine');
INSERT INTO CommodityType VALUES('kyanite','5000000.0','2000000.0','500000.0','100000.0','t','kyanite','Triclinic Al2SiO5 aluminium neosilicate mineral used primarily in refractory and ceramic products, including porcelain plumbing fixtures and dishware. It is also used in electronics, electrical insulators and abrasives. http://www.webmineral.com/data/Kyanite.shtml http://en.wikipedia.org/wiki/Kyanite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/kyanite');
INSERT INTO CommodityType VALUES('kyaniteGemstone','10.0','5.0','0.5','0.1','t','kyanite-gemstone','Kyanite is an attractive mineral that has a near sapphire-like blue color in some especially nice specimens - http://www.galleries.com/Kyanite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/kyaniteGemstone');
INSERT INTO CommodityType VALUES('lanthanum',null,null,null,null,null,'lanthanum','Lanthanum is a chemical element with the symbol La and atomic number 57. Lanthanum is a silvery white metallic element and is the first element of the lanthanide series (or, on occasion, considered the first element of the 6th-period transition metals). - http://en.wikipedia.org/wiki/Lanthanum','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/lanthanum');
INSERT INTO CommodityType VALUES('laterite',null,null,null,null,null,'laterite','Deeply weathered rock material, weakly consolidated, composed of relict quartz, and clays or oxide minerals produced by weathering of source rock. Used historically for building construction. http://en.wikipedia.org/wiki/Laterite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/laterite');
INSERT INTO CommodityType VALUES('lazulite','500000.0','200000.0','50000.0','10000.0','t','lazulite','Lazulite is named from an Arabic word for heaven in allusion to its sky blue color. Crystals are more common than massive forms, but localities with gem grade crystals are scattered and scarce. - http://www.galleries.com/Lazulite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/lazulite');
INSERT INTO CommodityType VALUES('lead','5000000.0','500000.0','50000.0','5000.0','t','lead','Lead is a chemical element in the carbon group with symbol Pb and atomic number 82. Lead is a soft and malleable metal, which is regarded as a heavy metal and an other metal. Metallic lead has a bluish-white color after being freshly cut, but it soon tarnishes to a dull grayish color when exposed to air. - http://en.wikipedia.org/wiki/Lead','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/lead');
INSERT INTO CommodityType VALUES('leucoxene',null,null,null,null,null,'leucoxene','Leucoxene is a fine granular alteration product of titanium minerals. It varies in color from yellow to brown.It consists mainly of rutile or anatase. It is observed in some igneous rocks and iron ore deposits as the result of the alteration of ilmenite, perovskite, or titanite - http://en.wikipedia.org/wiki/Leucoxene','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/leucoxene');
INSERT INTO CommodityType VALUES('lime','50000000.0','10000000.0','2000000.0','500000.0','t','lime','Strictly speaking, lime is calcium oxide or calcium hydroxide, but the category is commonly applied to calcium-containing inorganic material in which carbonates, oxides and hydroxides predominate. -  http://en.wikipedia.org/wiki/Lime_(material)','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/lime');
INSERT INTO CommodityType VALUES('limestone','250000000.0','50000000.0','10000000.0','2000000.0','t','limestone','Commercial limestones are rocks of sedimentary origin that primarily are composed of calcium carbonate with or without magnesium. Included in this category are limestone, dolomite, dolomitic limestone, and travertine, which is a calcitic rock that is precipitated from hot springs. http://minerals.usgs.gov/minerals/pubs/commodity/stone_dimension/myb1-2007-stond.pdf','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/limestone');
INSERT INTO CommodityType VALUES('liquidHydrocarbons','1000000000.0','100000000.0','10000000.0','1000000.0','m3','liquid hydrocarbons','Liquid hydrocarbons consist of hydrocarbons of various molecular weights and other liquid or semi-solid organic compounds.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/liquidHydrocarbons');
INSERT INTO CommodityType VALUES('lithium','465000.0','46500.0','23200.0','2320.0','t','lithium','Lithium is a chemical element with symbol Li and atomic number 3. It is a soft, silver-white metal belonging to the alkali metal group of chemical elements. Under standard conditions it is the lightest metal and the least dense solid element. - http://en.wikipedia.org/wiki/Lithium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/lithium');
INSERT INTO CommodityType VALUES('lithiumOxide','1000000.0','100000.0','50000.0','5000.0','t','lithium oxide','Lithium oxide is used as a flux in ceramic glazes; and creates blues with copper and pinks with cobalt. Lithium oxide reacts with water and steam, forming lithium hydroxide and should be isolated from them. - http://en.wikipedia.org/wiki/Lithium_oxide','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/lithiumOxide');
INSERT INTO CommodityType VALUES('LREE','15000000.0','1500000.0','150000.0','15000.0','t','LREE','Light Rare Earth Element - See - http://en.wikipedia.org/wiki/Rare_earth_element','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/LREE');
INSERT INTO CommodityType VALUES('LREO',null,null,null,null,null,'LREO','Light Rare Earth Oxide - See - http://en.wikipedia.org/wiki/Rare_earth_element','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/LREO');
INSERT INTO CommodityType VALUES('lutetium',null,null,null,null,null,'lutetium','Lutetium is a chemical element with the symbol Lu and atomic number 71. It is a silvery white metal, which resists corrosion in dry, but not in moist air. It is the last element in the lanthanide series (or, on occasion, considered the first element of the 6th-period transition metals), and traditionally counted among the rare earths. - http://en.wikipedia.org/wiki/Lutetium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/lutetium');
INSERT INTO CommodityType VALUES('magnesia',null,null,null,null,null,'magnesia','Magnesium oxide (MgO), or magnesia, is a white hygroscopic solid mineral that occurs naturally as periclase and is a source of magnesium (see also oxide). - http://en.wikipedia.org/wiki/Magnesium_oxide','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/magnesia');
INSERT INTO CommodityType VALUES('magnesite','100000000.0','10000000.0','1000000.0','100000.0','t','magnesite','Magnesite does not ordinarily form good crystals, but can make up a substantial portion of some rock types. It forms commonly from the alteration of magnesium-rich rocks during low grade metamorphism while they are in contact with carbonate-rich solutions.- http://www.galleries.com/Magnesite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/magnesite');
INSERT INTO CommodityType VALUES('magnesium','100000000.0','20000000.0','5000000.0','500000.0','t','magnesium','Magnesium is a chemical element with the symbol Mg and atomic number 12. Its common oxidation number is +2. It is an alkaline earth metal and the eighth-most-abundant element in the Earth''s crust and ninth in the known universe as a whole. - http://en.wikipedia.org/wiki/Magnesium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/magnesium');
INSERT INTO CommodityType VALUES('magnetite',null,null,null,null,null,'magnetite','Magnetite is an oxide of iron (as is hematite). It is not a component of ordinary rust, although it can form as iron oxidizes in a dry environment. - http://www.galleries.com/Magnetite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/magnetite');
INSERT INTO CommodityType VALUES('magnetiteOre',null,null,null,null,null,'magnetite ore','Iron ore in which the iron-bearing mineral is greater that 50% magnetite.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/magnetiteOre');
INSERT INTO CommodityType VALUES('malachite','5000.0','2000.0','500.0','100.0','t','malachite','Malachite is a famous and very popular semi-precious stone. It is named for the Greek word for "mallow", a green herb. Its banded light and dark green designs are one-of-a-kind, and give it a unique ornamental quality unlike that of any other stone. - http://www.galleries.com/Malachite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/malachite');
INSERT INTO CommodityType VALUES('manganese','100000000.0','10000000.0','1000000.0','100000.0','t','manganese','Manganese is a chemical element, designated by the symbol Mn. It has the atomic number 25. It is not found as a free element in nature, it is often found in combination with iron, and in many minerals. Manganese is a metal with important industrial metal alloy uses, particularly in stainless steels. - http://en.wikipedia.org/wiki/Manganese','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/manganese');
INSERT INTO CommodityType VALUES('manganeseOre',null,null,null,null,null,'manganese ore','Manganese ore occurs mainly as pyrolusite (MnO2) and rhodochrosite (MnCO3) at grades greater than 20% Mn. The ore is beneficiated via crushing, screening and separation before being directly shipped to be used in blast furnaces for steel manufacture. Manganese ore is also used in fertiliser manufacture, for batteries as manganese dioxide and as paint pigments without needing to be reduced to elemental manganese.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/manganeseOre');
INSERT INTO CommodityType VALUES('marble','50000000.0','10000000.0','2000000.0','500000.0','t','marble','Commercial marble includes metamorphosed limestones and serpentine rocks, all of which are capable of taking a polish. An important member of this classification is serpentine marble, which is also known as verde antique, and comprises green-to-black serpentine, which is a hydrous magnesium silicate mineral that is crisscrossed by veins of lighter minerals, such as calcite or dolomite. http://minerals.usgs.gov/minerals/pubs/commodity/stone_dimension/myb1-2007-stond.pdf','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/marble');
INSERT INTO CommodityType VALUES('mercury','50000.0','5000.0','500.0','100.0','t','mercury','Mercury is a chemical element with the symbol Hg and atomic number 80. It is commonly known as quicksilver and was formerly named hydrargyrum. A heavy, silvery d-block element, mercury is the only metallic element that is liquid at standard conditions for temperature and pressure; the only other element that is liquid under these conditions is bromine, though metals such as caesium, gallium, and rubidium melt just above room temperature. - http://en.wikipedia.org/wiki/Mercury_(element)','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/mercury');
INSERT INTO CommodityType VALUES('metal',null,null,null,null,null,'metal','Commodity is a metal that is extracted from an ore material mined from the Earth','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/metal');
INSERT INTO CommodityType VALUES('metalloid',null,null,null,null,null,'metalloid','A metalloid is a chemical element that has properties in between those of metals and nonmetals. There is no standard definition of a metalloid, nor is there complete agreement as to which elements are appropriately classified as such. Despite this lack of specificity, the term remains in use in chemistry literature. The six commonly recognised metalloids are boron, silicon, germanium, arsenic, antimony and tellurium. - http://en.wikipedia.org/wiki/Metalloid','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/metalloid');
INSERT INTO CommodityType VALUES('mica','100000.0','20000.0','5000.0','500.0','t','mica','The mica group of sheet silicate (phyllosilicate) minerals includes several closely related materials having close to perfect basal cleavage. All are monoclinic, with a tendency towards pseudohexagonal crystals, and are similar in chemical composition. - http://en.wikipedia.org/wiki/Mica','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/mica');
INSERT INTO CommodityType VALUES('miscellaneousDimensionStones','50000000.0','10000000.0','2000000.0','500000.0','t','miscellaneous dimension stones','This category includes commercial dimension stone types that do not easily fall into the aforementioned categories, such as soapstone, steatite, or talc, which contain various amounts of the mineral talc. Additional miscellaneous dimension stones include diatomite, mylonite, pumice, schist, tripoli, tuff, porous or scoriaceous volcanic rocks, or any other rocks used as building stones. http://minerals.usgs.gov/minerals/pubs/commodity/stone_dimension/myb1-2007-stond.pdf','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/miscellaneousDimensionStones');
INSERT INTO CommodityType VALUES('molybdenite',null,null,null,null,null,'molybdenite','Molybdenite is a very soft metallic mineral. It can be easily confused with graphite, but not with many other minerals. Graphite has a darker black-silver color and a black-gray to brown-gray streak, whereas molybdenite has a bluish-silver color and streak. - http://www.galleries.com/Molybdenite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/molybdenite');
INSERT INTO CommodityType VALUES('molybdenum','500000.0','100000.0','5000.0','1000.0','t','molybdenum','Molybdenum is a Group 6 chemical element with the symbol Mo and atomic number 42. The name is from Neo-Latin Molybdaenum, from Ancient Greek Μόλυβδος molybdos, meaning lead, since its ores were confused with lead ores. - http://en.wikipedia.org/wiki/Molybdenum','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/molybdenum');
INSERT INTO CommodityType VALUES('monazite',null,null,null,null,null,'monazite','Monazite is a reddish-brown phosphate mineral containing rare earth metals. It occurs usually in small isolated crystals. There are at least four different kinds of monazite, depending on relative elemental composition of the mineral - http://en.wikipedia.org/wiki/Monazite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/monazite');
INSERT INTO CommodityType VALUES('moonstone','10.0','1.0','0.1','0.01','t','moonstone','Moonstone is a sodium potassium aluminium silicate, with the chemical formula (Na,K)AlSi3O8. - http://en.wikipedia.org/wiki/Moonstone_(gemstone)','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/moonstone');
INSERT INTO CommodityType VALUES('morganite','10000000.0','1000000.0','100000.0','10000.0','ct','morganite','Morganite is the pink variety of beryl, the "mother of gemstones". While there are other pink gemstones (rose quartz and tourmaline come to mind), morganite is the most durable and rarest. - http://www.galleries.com/Morganite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/morganite');
INSERT INTO CommodityType VALUES('mossAgate','1000.0','100.0','10.0','1.0','t','moss agate','Moss agate (also called mocha stone) is a semi-precious gemstone formed from silicon dioxide. It is a form of chalcedony which includes minerals of a green colour embedded in the stone, forming filaments and other patterns suggestive of moss. It also sometimes resembles blue-cheese. The field is a clear or milky-white quartz, and the included minerals are mainly oxides of manganese or iron. It is not a true form of agate, as it lacks agate''s defining feature of concentric banding. Moss agate is of the white variety with green inclusions that resemble moss. It occurs  - http://en.wikipedia.org/wiki/Moss_agate','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/mossAgate');
INSERT INTO CommodityType VALUES('naturalSecondaryAggregate','250000000.0','50000000.0','10000000.0','2000000.0','t','natural secondary aggregate','Aggregates produced as a by-product of other mining or quarrying activities such as china clay waste, slate waste and colliery spoil','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/naturalSecondaryAggregate');
INSERT INTO CommodityType VALUES('neodymium',null,null,null,null,null,'neodymium','Neodymium is a chemical element with the symbol Nd and atomic number 60. It is a soft silvery metal that tarnishes in air. - http://en.wikipedia.org/wiki/Neodymium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/neodymium');
INSERT INTO CommodityType VALUES('nephelineSyenite','100000000.0','20000000.0','5000000.0','1000000.0','t','nepheline syenite','In the IUGS classification, the variety of foid syenite in which nepheline is the most abundant feldspathoid.  - AGI - Glossary of geology','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/nephelineSyenite');
INSERT INTO CommodityType VALUES('nickel','2000000.0','500000.0','20000.0','2000.0','t','nickel','Nickel is a chemical element with the chemical symbol Ni and atomic number 28. It is a silvery-white lustrous metal with a slight golden tinge. Nickel belongs to the transition metals and is hard and ductile. - http://en.wikipedia.org/wiki/Nickel','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/nickel');
INSERT INTO CommodityType VALUES('niobium','699000.0','69900.0','6990.0','1400.0','t','niobium','Niobium, formerly columbium, is a chemical element with the symbol Nb (formerly Cb) and atomic number 41. It is a soft, grey, ductile transition metal, which is often found in the pyrochlore mineral, the main commercial source for niobium, and columbite. - http://en.wikipedia.org/wiki/Niobium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/niobium');
INSERT INTO CommodityType VALUES('niobiumPentoxide','1000000.0','100000.0','10000.0','2000.0','t','niobium pentoxide','Niobium pentoxide is the inorganic compound with the formula Nb2O5. It is a colourless insoluble solid that is fairly unreactive. It is the main precursor to all materials made of niobium, the dominant application being alloys, but other specialized applications include capacitors, lithium niobate, and optical glasses. - http://en.wikipedia.org/wiki/Niobium_pentoxide','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/niobiumPentoxide');
INSERT INTO CommodityType VALUES('nitrate','100000000.0','10000000.0','1000000.0','100000.0','t','nitrate','Nitrates are mainly produced for use as fertilizers in agriculture because of their high solubility and biodegradability. The main nitrates are ammonium, sodium, potassium, and calcium salts. Several million kilograms are produced annually for this purpose. - http://en.wikipedia.org/wiki/Nitrate','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/nitrate');
INSERT INTO CommodityType VALUES('nonMetal',null,null,null,null,null,'non metal','In chemistry, a nonmetal or non-metal is a chemical element which mostly lacks metallic attributes. Physically, nonmetals tend to be highly volatile (easily vaporised), have low elasticity, and are good insulators of heat and electricity; chemically, they tend to have high ionisation energy and electronegativity values, and gain or share electrons when they react with other elements or compounds. Seventeen elements are generally classified as nonmetals; most are gases (hydrogen, helium, nitrogen, oxygen, fluorine, neon, chlorine, argon, krypton, xenon and radon) one is a liquid (bromine) and a few are solids (carbon, phosphorus, sulfur, selenium, and iodine). - http://en.wikipedia.org/wiki/Non-metal','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/nonMetal');
INSERT INTO CommodityType VALUES('obsidian',null,null,null,null,null,'obsidian','Obsidian is the result of volcanic lava coming in contact with water. Often the lava pours into a lake or ocean and is cooled quickly. This process produces a glassy texture in the resulting rock. Iron and magnesium give the obsidian a dark green to black color. Obsidian has been used by ancient people as a cutting tool, for weapons, and for ceremonial purposes and is sometimes found by archaeologists in excavations. - http://www.galleries.com/Obsidian','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/obsidian');
INSERT INTO CommodityType VALUES('ochre',null,null,null,null,null,'ochre','Ochre is a natural earth pigment containing hydrated iron oxide, which ranges in color from yellow to deep orange or brown. It is also the name of the colors produced by this pigment, especially a light brownish-yellow. A variant of ochre containing a large amount of hematite, or dehydrated iron oxide, has a reddish tint known as "red ochre". - http://en.wikipedia.org/wiki/Ochre','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/ochre');
INSERT INTO CommodityType VALUES('oil',null,null,null,null,null,'oil','Oil or petroleum consists of hydrocarbons of various molecular weights such as alkanes (pentane, hexane, heptane, octane) and other liquid organic compounds, typically recovered from drilling of underground reservoirs. http://en.wikipedia.org/wiki/Petroleum','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/oil');
INSERT INTO CommodityType VALUES('oilShale','1000000000.0','100000000.0','10000000.0','1000000.0','t','oil shale','Fine-grained sedimentary rock, yielding significant quantities of oil upon decomposition by heating to high temperatures','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/oilShale');
INSERT INTO CommodityType VALUES('olivine','100000000.0','50000000.0','10000000.0','2000000.0','t','olivine',null,'http://inspire.ec.europa.eu/codelist/CommodityCodeValue/olivine');
INSERT INTO CommodityType VALUES('olivineGemstone','10.0','5.0','0.5','0.1','t','olivine-gemstone','Peridot is gem-quality olivine. Olivine is a silicate mineral with formula of (Mg, Fe)2SiO4. As peridot is the magnesium-rich variety (forsterite) the formula approaches Mg2SiO4. - http://en.wikipedia.org/wiki/Peridot','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/olivineGemstone');
INSERT INTO CommodityType VALUES('onyx',null,null,null,null,null,'onyx','Onyx is a black-and-white banded agate - http://www.quartzpage.de/agate.html#onyx','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/onyx');
INSERT INTO CommodityType VALUES('opal','10000000.0','1000000.0','100000.0','10000.0','ct','opal','Opal is a hydrated amorphous form of silica; its water content may range from 3 to 21% by weight, but is usually between 6 and 10%. Because of its amorphous character, it is classed as a mineraloid - http://en.wikipedia.org/wiki/Opal','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/opal');
INSERT INTO CommodityType VALUES('organicMaterial',null,null,null,null,null,'organic material','Earth material composed of organic compounds derived from the remains of dead organisms and their waste products in the environment.  Larger molecules of organic matter can be formed from the polymerization of different parts of already broken down matter. - http://en.wikipedia.org/wiki/Organic_matter','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/organicMaterial');
INSERT INTO CommodityType VALUES('osmium','25.0','5.0','1.0','0.1','t','osmium','Osmium is a chemical element with the symbol Os and atomic number 76. It is a hard, brittle, bluish-white transition metal in the platinum group that is found as a trace element in alloys, mostly in platinum ores. - Osmium (from Greek osme (ὀσμή) meaning "smell") is a chemical element with the symbol Os and atomic number 76. It is a hard, brittle, bluish-white transition metal in the platinum group that is found as a trace element in alloys, mostly in platinum ores.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/osmium');
INSERT INTO CommodityType VALUES('palladium','1000.0','100.0','10.0','1.0','t','palladium','Palladium is a chemical element with the chemical symbol Pd and an atomic number of 46. It is a rare and lustrous silvery-white metal. - http://en.wikipedia.org/wiki/Palladium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/palladium');
INSERT INTO CommodityType VALUES('palygorskite','5000000.0','2000000.0','500000.0','100000.0','t','palygorskite','Palygorskite or attapulgite is a magnesium aluminium phyllosilicate with formula (Mg,Al)2Si4O10(OH)·4(H2O) that occurs in a type of clay soil common to the Southeastern United States. It is one of the types of fuller''s earth. http://en.wikipedia.org/wiki/Attapulgite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/palygorskite');
INSERT INTO CommodityType VALUES('peat','500000000.0','50000000.0','5000000.0','500000.0','t','peat','An accumulation of partially decayed vegetation or organic matter that forms in wetland conditions, where flooding obstructs flows of oxygen from the atmosphere, slowing rates of decomposition. Peat is commonly harvested as an important source of fuel in certain parts of the world. http://en.wikipedia.org/wiki/Peat','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/peat');
INSERT INTO CommodityType VALUES('perlite','20000000.0','10000000.0','5000000.0','1000000.0','t','perlite','''Perlite'' is a volcanic glass with sufficient water content to cause it to expand, or froth up, when heated, forming a lightweight granular aggregate; used in construction, insulation, packaging and agriculture','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/perlite');
INSERT INTO CommodityType VALUES('phenakite','10000000.0','1000000.0','100000.0','10000.0','ct','phenakite','A fairly rare nesosilicate mineral consisting of beryllium orthosilicate, Be2SiO4 http://en.wikipedia.org/wiki/Phenakite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/phenakite');
INSERT INTO CommodityType VALUES('phosphateRock',null,null,null,null,null,'phosphate rock','Any rock that contains one or more phosphatic minerals of sufficient purity and quantity to permit its commercial use as a source of phosphatic compounds or elemental phosphorus. About 90% of the world''s production is sedimentary phosphate rock, or phosphorite; the remainder is igneous rock rich in apatite.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/phosphateRock');
INSERT INTO CommodityType VALUES('phosphorous','87300000.0','8730000.0','873000.0','87300.0','t','phosphorous','Phosphorus is a nonmetallic chemical element with symbol P and atomic number 15. A multivalent pnictogen, phosphorus as a mineral is almost always present in its maximally oxidised state, as inorganic phosphate rocks. Elemental phosphorus exists in two major forms—white phosphorus and red phosphorus—but due to its high reactivity, phosphorus is never found as a free element on Earth. - http://en.wikipedia.org/wiki/Phosphorus','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/phosphorous');
INSERT INTO CommodityType VALUES('phosphorousPentoxide','200000000.0','20000000.0','2000000.0','200000.0','t','phosphorous pentoxide','Phosphorus pentoxide is a chemical compound with molecular formula P4O10 (with its common name derived from its empirical formula, P2O5). This white crystalline solid is the anhydride of phosphoric acid. It is a powerful desiccant and dehydrating agent. - http://en.wikipedia.org/wiki/Phosphorous_pentoxide','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/phosphorousPentoxide');
INSERT INTO CommodityType VALUES('platinum','1000.0','100.0','10.0','1.0','t','platinum','Platinum is a chemical element with the chemical symbol Pt and an atomic number of 78. It is a dense, malleable, ductile, highly unreactive, precious, gray-white transition metal. - http://en.wikipedia.org/wiki/Platinum','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/platinum');
INSERT INTO CommodityType VALUES('platinumGroupMetal','1000.0','100.0','10.0','1.0','t','platinum group metal','The platinum-group metals (abbreviated as the PGMs; alternatively, the platinoids, platinides, platidises, platinum group, platinum metals, platinum family or platinum-group elements (PGEs)) is a term used sometimes to collectively refer to six metallic elements clustered together in the periodic table. - http://en.wikipedia.org/wiki/Platinum_group_metal','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/platinumGroupMetal');
INSERT INTO CommodityType VALUES('potash','500000000.0','50000000.0','5000000.0','500000.0','t','potash','Potash is any of various salts that contain potassium in water-soluble form, the most common being potassium chloride (KCl). Mostly used in fertilizers. - http://en.wikipedia.org/wiki/Potash','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/potash');
INSERT INTO CommodityType VALUES('potassium',null,null,null,null,null,'potassium','Potassium is a chemical element with symbol K (from Neo-Latin kalium) and atomic number 19. Elemental potassium is a soft silvery-white alkali metal that oxidizes rapidly in air and is very reactive with water, generating sufficient heat to ignite the hydrogen emitted in the reaction and burning with a lilac flame. - http://en.wikipedia.org/wiki/Potassium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/potassium');
INSERT INTO CommodityType VALUES('pozzolan','100000000.0','50000000.0','10000000.0','2000000.0','t','pozzolan','Pozzolan is a siliceous or siliceous and aluminous material which will react chemically with calcium hydroxide to form compounds possessing cementitious properties (ASTM C618). The broad definition of a pozzolan imparts no bearing on the origin of the material, only on its capability of reacting with calcium hydroxide and water.... The general definition of a pozzolan embraces a large number of materials which vary widely in terms of origin, composition and properties. - http://en.wikipedia.org/wiki/Pozzolan','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/pozzolan');
INSERT INTO CommodityType VALUES('praseodymium',null,null,null,null,null,'praseodymium','Praseodymium is a chemical element that has the symbol Pr and atomic number 59. Praseodymium is a soft, silvery, malleable and ductile metal in the lanthanide group. - http://en.wikipedia.org/wiki/Praseodymium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/praseodymium');
INSERT INTO CommodityType VALUES('preciousMetal',null,null,null,null,null,'precious metal','A precious metal is a rare, naturally occurring metallic chemical element of high economic value. Chemically, the precious metals tend to be less reactive than most elements. They are usually ductile and have a high lustre. Historically, precious metals were important as currency but are now regarded mainly as investment and industrial commodities. Gold, silver, platinum, and palladium each have an ISO 4217 currency code. The best-known precious metals are the coinage metals, gold and silver. While both have industrial uses, they are better known for their uses in art, jewellery and coinage. Other precious metals include the platinum group metals: ruthenium, rhodium, palladium, osmium, iridium, and platinum, of which platinum is the most widely traded. - http://en.wikipedia.org/wiki/Precious_metal','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/preciousMetal');
INSERT INTO CommodityType VALUES('prehnite',null,null,null,null,null,'prehnite','Prehnite was named after its discoverer; Colonel Hendrik von Prehn and is an attractive collection mineral that is occassionally used for ornamental stone purposes. - http://www.galleries.com/Prehnite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/prehnite');
INSERT INTO CommodityType VALUES('primaryAggregate','250000000.0','50000000.0','10000000.0','2000000.0','t','primary aggregate','Sand and gravel and crushed rock extracted from the ground','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/primaryAggregate');
INSERT INTO CommodityType VALUES('producedCommodity',null,null,null,null,null,'produced commodity','Commodity is obtained by extracting from material mined from the Earth.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/producedCommodity');
INSERT INTO CommodityType VALUES('promethium',null,null,null,null,null,'promethium','Promethium, originally prometheum, is a chemical element with the symbol Pm and atomic number 61. All of its isotopes are radioactive; it is one of only two such elements that are followed in the periodic table by elements with stable forms, a distinction shared with technetium. - http://en.wikipedia.org/wiki/Promethium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/promethium');
INSERT INTO CommodityType VALUES('pumice','100000000.0','50000000.0','10000000.0','2000000.0','t','pumice','A volcanic rock that consists of highly vesicular rough textured volcanic glass, which may or may not contain crystals. It is typically light colored. Scoria is another vesicular volcanic rock that differs from pumice in having larger vesicles and thicker vesicle walls and being dark colored and denser. - http://en.wikipedia.org/wiki/Pumice','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/pumice');
INSERT INTO CommodityType VALUES('pyrite','100000000.0','20000000.0','5000000.0','200000.0','t','pyrite','The mineral pyrite, or iron pyrite, also known as fool''s gold, is an iron sulfide with the chemical formula FeS2. This mineral''s metallic luster and pale brass-yellow hue give it a superficial resemblance to gold, hence the well-known nickname of fool''s gold. - http://en.wikipedia.org/wiki/Pyrite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/pyrite');
INSERT INTO CommodityType VALUES('pyrophyllite','20000000.0','5000000.0','1000000.0','100000.0','t','pyrophyllite','A phyllosilicate mineral composed of aluminium silicate hydroxide: Al2Si4O10(OH)2. Pyrophyllite is easily machineable and has excellent thermal stability and is added to clay to reduce thermal expansion when firing and is combined with other compounds, such as in insecticide and for making bricks. It is also used for slate pencils, chalk (French chalk) and small carving. http://www.webmineral.com/data/Pyrophyllite.s html http://en.wikipedia.org/wiki/Pyrophyllite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/pyrophyllite');
INSERT INTO CommodityType VALUES('quartz','10000000.0','1000000.0','100000.0','10000.0','t','quartz','Quartz is the second most abundant mineral in the Earth''s continental crust, after feldspar. It is made up of a continuous framework of SiO4 silicon–oxygen tetrahedra, with each oxygen being shared between two tetrahedra, giving an overall formula SiO2. There are many different varieties of quartz, several of which are semi-precious gemstones. - http://en.wikipedia.org/wiki/Quartz','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/quartz');
INSERT INTO CommodityType VALUES('quartzGemstone','100.0','10.0','1.0','0.1','t','quartz-gemstone','Quartz is the most common mineral on the face of the Earth. Some macrocrystalline (large crystal) varieties are well known and popular as ornamental stone and as gemstones. - http://www.galleries.com/Quartz','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/quartzGemstone');
INSERT INTO CommodityType VALUES('radium',null,null,null,null,null,'radium','Radium is a chemical element with symbol Ra and atomic number 88. Radium is an almost pure-white alkaline earth metal, but it readily oxidizes on exposure to air, becoming black in color. - http://en.wikipedia.org/wiki/Radium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/radium');
INSERT INTO CommodityType VALUES('recycledAggregate','250000000.0','50000000.0','10000000.0','2000000.0','t','recycled aggregate','Recycled aggregates are materials produced by the recycling of construction and demolition waste. They can be crushed concrete, bricks or glass, asphalt planings (ie the surface layers of roads removed during roadworks) or spent rail ballast.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/recycledAggregate');
INSERT INTO CommodityType VALUES('reservoirGas','1000.0','250.0','50.0','10.0','km3','reservoir gas','Natural gas derived from underground rock reservoirs typically containing methane with lesser amounts of ethane, propane, butane and pentane. Natural gas is commonly associated with liquid petroleum in the reservoirs but is extracted and managed differently.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/reservoirGas');
INSERT INTO CommodityType VALUES('rhenium','5000.0','500.0','50.0','5.0','t','rhenium','Rhenium is a chemical element with the symbol Re and atomic number 75. It is a silvery-white, heavy, third-row transition metal in group 7 of the periodic table. With an estimated average concentration of 1 part per billion (ppb), rhenium is one of the rarest elements in the Earth''s crust. - http://en.wikipedia.org/wiki/Rhenium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/rhenium');
INSERT INTO CommodityType VALUES('rhodium','25.0','5.0','1.0','0.1','t','rhodium','Rhodium is a chemical element that is a rare, silvery-white, hard, and chemically inert transition metal and a member of the platinum group. It has the chemical symbol Rh and atomic number 45. - http://en.wikipedia.org/wiki/Rhodium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/rhodium');
INSERT INTO CommodityType VALUES('rhodonite','10000000.0','1000000.0','100000.0','10000.0','ct','rhodonite','Rhodonite is an attractive mineral that is often carved and used in jewelry. It is named after the Greek word for rose, rhodon. - http://www.galleries.com/Rhodonite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/rhodonite');
INSERT INTO CommodityType VALUES('riprap','250000000.0','50000000.0','10000000.0','2000000.0','t','riprap','Boulder size rock used to armour shorelines, streambeds, bridge abutments, pilings and other shoreline structures against scour, water or ice erosion.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/riprap');
INSERT INTO CommodityType VALUES('roseQuartz','100.0','10.0','1.0','0.1','t','rose quartz','Rose quartz is a type of quartz which exhibits a pale pink to rose red hue - http://en.wikipedia.org/wiki/Rose_quartz#Rose_quartz','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/roseQuartz');
INSERT INTO CommodityType VALUES('rubidium','920.0','92.0','9.0','1.0','t','rubidium','Rubidium is a chemical element with the symbol Rb and atomic number 37. Rubidium is a soft, silvery-white metallic element of the alkali metal group, with an atomic mass of 85.4678. Elemental rubidium is highly reactive, with properties similar to those of other alkali metals, such as very rapid oxidation in air. - http://en.wikipedia.org/wiki/Rubidium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/rubidium');
INSERT INTO CommodityType VALUES('ruby','10000000.0','1000000.0','100000.0','10000.0','ct','ruby','A ruby is a pink to blood-red colored gemstone, a variety of the mineral corundum (aluminium oxide).  - http://en.wikipedia.org/wiki/Ruby','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/ruby');
INSERT INTO CommodityType VALUES('ruthenium','25.0','5.0','1.0','0.1','t','ruthenium','Ruthenium is a chemical element with symbol Ru and atomic number 44. It is a rare transition metal belonging to the platinum group of the periodic table. - http://en.wikipedia.org/wiki/Ruthenium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/ruthenium');
INSERT INTO CommodityType VALUES('rutile','2000000.0','200000.0','20000.0','2000.0','t','rutile','Rutile is an interesting, varied and important mineral. Rutile is a major ore of titanium, a metal used for high tech alloys because of its light weight, high strength and resistance to corrosion. - http://www.galleries.com/Rutile','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/rutile');
INSERT INTO CommodityType VALUES('salt','2000000000.0','200000000.0','20000000.0','2000000.0','t','salt','Common salt is a mineral substance composed primarily of sodium chloride (NaCl), a chemical compound belonging to the larger class of ionic salts; salt in its natural form as a crystalline mineral is known as rock salt or halite. Salt is present in vast quantities in the sea where it is the main mineral constituent, with the open ocean having about 35 grams (1.2 oz) of solids per litre, a salinity of 3.5%. - http://en.wikipedia.org/wiki/Salt','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/salt');
INSERT INTO CommodityType VALUES('samarium',null,null,null,null,null,'samarium','Samarium is a chemical element with symbol Sm and atomic number 62. It is a moderately hard silvery metal that readily oxidizes in air. Being a typical member of the lanthanide series. - http://en.wikipedia.org/wiki/Samarium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/samarium');
INSERT INTO CommodityType VALUES('sand','250000000.0','50000000.0','10000000.0','2000000.0','t','sand','Industrial sand is a term normally applied to high purity silica sand products with closely controlled sizing.  It is a more precise product than common concrete and asphalt gravels.  Silica is the name given to a group of minerals composed solely of silicon and oxygen, the two most abundant elements in the earth’s crust.  - http://www.sand.org/What-is-Industrial-Sand','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/sand');
INSERT INTO CommodityType VALUES('sandAndGravel','250000000.0','50000000.0','10000000.0','2000000.0','t','sand and gravel','Durable rock fragments (silicates, flints, etc) with a size range: 0.063 mm - 80mm, derived from the weathering, erosion and transport of rocks by glacial or fluvial processes. Used for aggregate purposes and construction fill.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/sandAndGravel');
INSERT INTO CommodityType VALUES('sandstone','250000000.0','50000000.0','10000000.0','2000000.0','t','sandstone','Commercial sandstone is a lithified sand that chiefly comprises quartz or quartz and feldspar with a fragmental (clastic) texture. Sandstone contains interstitial cementing materials, such as calcite, clay, iron oxides, or silica. Arkose (abundant feldspar grains), graywacke (abundant angular rock fragments), and conglomerate (abundant rounded rock fragments) are included in this category. Other members of this category include bluestone, which is a dense, hard, fine-grained feldspathic sandstone that splits easily along planes into thin, smooth slabs; brownstone, which can be sawn or split, is a feldspathic sandstone of brown to reddish-brown color owing to abundant iron oxide; and flagstone, which is a sandstone, or sandy slate, typically red, tan or gray, that splits into large, thin slabs. http://minerals.usgs.gov/minerals/pubs/commodity/stone_dimension/myb1-2007-stond.pdf','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/sandstone');
INSERT INTO CommodityType VALUES('saponite',null,null,null,null,null,'saponite','A smectite group mineral, occurs insoapstone used in porcelain in Cornwall - http://en.wikipedia.org/wiki/Saponite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/saponite');
INSERT INTO CommodityType VALUES('sapphire','10000000.0','1000000.0','100000.0','10000.0','ct','sapphire','Sapphire is a blue gemstone variety of the mineral corundum. - http://en.wikipedia.org/wiki/Sapphire','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/sapphire');
INSERT INTO CommodityType VALUES('sapphirine',null,null,null,null,null,'sapphirine','Sapphire is the non-red variety of corundum, the second hardest natural mineral known to mankind. The red variety of corundum is Ruby - all other colors are called sapphire, even pink. - http://www.galleries.com/Sapphire','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/sapphirine');
INSERT INTO CommodityType VALUES('scandium',null,null,null,null,null,'scandium','Scandium is a chemical element with symbol Sc and atomic number 21. A silvery-white metallic d-block element, it has historically been sometimes classified as a rare earth element, together with yttrium and the lanthanoids. - http://en.wikipedia.org/wiki/Scandium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/scandium');
INSERT INTO CommodityType VALUES('scapolite','10000000.0','1000000.0','100000.0','10000.0','ct','scapolite','A group of rock-forming silicate minerals composed of aluminium, calcium, and sodium silicate with chlorine, carbonate and sulfate. - http://en.wikipedia.org/wiki/Scapolite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/scapolite');
INSERT INTO CommodityType VALUES('selenium','5000.0','1000.0','250.0','50.0','t','selenium','Selenium is a chemical element with symbol Se and atomic number 34. It is a nonmetal with properties that are intermediate between those of its periodic table column-adjacent chalcogen elements sulfur and tellurium. It rarely occurs in its elemental state in nature, or as pure ore compounds. - http://en.wikipedia.org/wiki/Selenium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/selenium');
INSERT INTO CommodityType VALUES('sepiolite','5000000.0','2000000.0','500000.0','100000.0','t','sepiolite','Sepiolite is used in oil drilling, for cat litter and in a solid form for carving, where it is known as Meerschaum. In construction, sepiolite can be used in lime mortars as water reservoir. http://en.wikipedia.org/wiki/Sepiolite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/sepiolite');
INSERT INTO CommodityType VALUES('sericite','100000.0','20000.0','5000.0','500.0','t','sericite','Sericite is a fine grained mica, similar to muscovite, illite, or paragonite. Sericite is a common alteration mineral of orthoclase or plagioclase feldspars in areas that have been subjected to hydrothermal alteration typically associated with hydrothermal ore deposits.- http://en.wikipedia.org/wiki/Sericite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/sericite');
INSERT INTO CommodityType VALUES('serpentine',null,null,null,null,null,'serpentine','The serpentine group are greenish, brownish, or spotted minerals commonly found in serpentinite rocks. They are used as a source of magnesium and asbestos, and as a decorative stone.[1] The name is thought to come from the greenish color being that of a serpent.- http://en.wikipedia.org/wiki/Serpentine_group','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/serpentine');
INSERT INTO CommodityType VALUES('shellGrit',null,null,null,null,null,'shell grit','Shell grit is coarsely ground or broken seashells. It is used, among other things, by birds as a source of calcium for egg shell production, and to aid digestion. - http://en.wikipedia.org/wiki/Shell_grit','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/shellGrit');
INSERT INTO CommodityType VALUES('silica','10000000.0','2500000.0','500000.0','100000.0','t','silica','Silicon dioxide, also known as silica (from the Latin silex), is a chemical compound that is a dioxide of silicon with the chemical formula SiO2 - http://en.wikipedia.org/wiki/Silica','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/silica');
INSERT INTO CommodityType VALUES('silicaGemstone','1000.0','100.0','10.0','1.0','t','silica-gemstone','http://en.wikipedia.org/wiki/Silica','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/silicaGemstone');
INSERT INTO CommodityType VALUES('silicon',null,null,null,null,null,'silicon','Silicon is a chemical element with the symbol Si and atomic number 14. It is a tetravalent metalloid, less reactive than its chemical analog carbon, the nonmetal directly above it in the periodic table, but more reactive than germanium, the metalloid directly below it in the table.  - http://en.wikipedia.org/wiki/Silicon','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/silicon');
INSERT INTO CommodityType VALUES('sillimanite','5000000.0','2000000.0','500000.0','100000.0','t','sillimanite','Orthorhombic Al2SiO5 aluminium neosilicate mineral occurring in aluminous metamorphic rocks used in the manufacture of high alumina refractories or alumina bricks. http://www.webmineral.com/data/Sillimanite.shtml http://en.wikipedia.org/wiki/Sillimanite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/sillimanite');
INSERT INTO CommodityType VALUES('silver','10000.0','2500.0','500.0','100.0','t','silver','Silver is a chemical element with the chemical symbol Ag and atomic number 47. A soft, white, lustrous transition metal, it possesses the highest electrical conductivity of any element and the highest thermal conductivity of any metal. - http://en.wikipedia.org/wiki/Silver','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/silver');
INSERT INTO CommodityType VALUES('sinhalite','10000000.0','1000000.0','100000.0','10000.0','ct','sinhalite','Sinhalite is rare mineral and known only from the gem gravels in Sri Lanka. - http://www.galleries.com/Sinhalite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/sinhalite');
INSERT INTO CommodityType VALUES('slate','5000000.0','2000000.0','500000.0','100000.0','t','slate','Commercial slate is a microgranular metamorphic rock formed by the recrystallization of clay sediments, such as claystone, shale, or siltstone. Characterized by excellent parallel cleavage, slates may be easily split into relatively thin slabs. http://minerals.usgs.gov/minerals/pubs/commodity/stone_dimension/myb1-2007-stond.pdf','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/slate');
INSERT INTO CommodityType VALUES('smokeyQuartz','100.0','10.0','1.0','0.1','t','smokey quartz','Smoky quartz is a brown to black variety of quartz - http://en.wikipedia.org/wiki/Smoky_quartz','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/smokeyQuartz');
INSERT INTO CommodityType VALUES('sodaAsh','100000000.0','10000000.0','1000000.0','100000.0','t','soda ash','The manufacture of glass is one of the most important uses of sodium carbonate. Sodium carbonate acts as a flux for silica, lowering the melting point of the mixture to something achievable without special materials. - http://en.wikipedia.org/wiki/Soda_ash','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/sodaAsh');
INSERT INTO CommodityType VALUES('sodalite','10.0','5.0','0.5','0.1','t','sodalite','Sodalite is a rich royal blue mineral widely enjoyed as an ornamental gemstone. Although massive sodalite samples are opaque, crystals are usually transparent to translucent. Sodalite is a member of the sodalite group with hauyne, nosean, lazurite and tugtupite. - see - http://en.wikipedia.org/wiki/Sodalite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/sodalite');
INSERT INTO CommodityType VALUES('spectrolite','10.0','1.0','0.1','0.01','t','spectrolite','A variety of labradorite feldspar that exhibits a richer range of colours than the blue-grey-green of labradorite, and high has labradoresence. Sometimes incorrectly used to describe labradorite whenever a richer display of colours is present, regardless of locality. - http://en.wikipedia.org/wiki/Spectrolite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/spectrolite');
INSERT INTO CommodityType VALUES('spinel','10000000.0','1000000.0','100000.0','10000.0','ct','spinel','Spinel /ˈspɪnɛl/ is the magnesium aluminium member of the larger spinel group of minerals. It has the formula MgAl2O4 - http://en.wikipedia.org/wiki/Spinel','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/spinel');
INSERT INTO CommodityType VALUES('spinelGemstone','10000000.0','1000000.0','100000.0','10000.0','ct','spinel-gemstone','The Spinel Group contains over twenty members, but only a few are considered common. They are a group of oxides that have very similar structures. Named after their sole gemstone representative, spinel, this is an important group of minerals. - http://www.galleries.com/Spinel_Group','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/spinelGemstone');
INSERT INTO CommodityType VALUES('spodumene',null,null,null,null,null,'spodumene','Spodumene is a rock forming mineral in granites and pegmatites that bear other lithium minerals. Spodumene is a relatively new mineral to science, being discovered in the last three centuries and gem varieties have only been discovered in the last 120 years. - http://www.galleries.com/Spodumene','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/spodumene');
INSERT INTO CommodityType VALUES('spongolite',null,null,null,null,null,'spongolite','Spongolite is a stone made almost entirely from fossilised sponges. It is light and porous. - http://en.wikipedia.org/wiki/Spongolite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/spongolite');
INSERT INTO CommodityType VALUES('staurolite','500000.0','100000.0','20000.0','5000.0','t','staurolite','Staurolite is a red brown to black, mostly opaque, nesosilicate mineral with a white streak. It crystallizes in the monoclinic crystal system, has a Mohs hardness of 7 to 7.5 and the chemical formula: Fe2+2Al9O6(SiO4)4(O,OH)2. - http://en.wikipedia.org/wiki/Staurolite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/staurolite');
INSERT INTO CommodityType VALUES('strontianite',null,null,null,null,null,'strontianite','Strontium carbonate, usually containing some calcium. It is a member of the aragonite group. Used in the refining of sugar and the production of fireworks. - http://www.minerals.net/mineral/strontianite.aspx,','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/strontianite');
INSERT INTO CommodityType VALUES('strontium','594000.0','59400.0','5940.0','594.0','t','strontium','Strontium (/ˈstrɒntiəm/ STRON-tee-əm) is a chemical element with symbol Sr and atomic number 38. An alkaline earth metal, strontium is a soft silver-white or yellowish metallic element that is highly reactive chemically. The metal turns yellow when it is exposed to air. Strontium has physical and chemical properties similar to those of its two neighbors calcium and barium. It occurs naturally in the minerals celestine, putnisite and strontianite. - http://en.wikipedia.org/wiki/Strontium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/strontium');
INSERT INTO CommodityType VALUES('sulphur','20000000.0','2000000.0','200000.0','20000.0','t','sulphur','Sulfur or sulphur is a chemical element with the symbol S and atomic number 16. It is an abundant, multivalent non-metal. Under normal conditions, sulfur atoms form cyclic octatomic molecules with chemical formula S8. Elemental sulfur is a bright yellow crystalline solid when at room temperature. - http://en.wikipedia.org/wiki/Sulphur','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/sulphur');
INSERT INTO CommodityType VALUES('sylvite','500000000.0','50000000.0','5000000.0','500000.0','t','sylvite','Sylvite, also called sylvine, is a major source of potassium or potash used in fertilizer products. So great is the need for potassium that sylvite deposits are considered very valuable economically. - http://www.galleries.com/Sylvite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/sylvite');
INSERT INTO CommodityType VALUES('talc','20000000.0','2000000.0','200000.0','20000.0','t','talc','Talc is an important industrial mineral. Its resistance to heat, electricity and acids make it an ideal surface for lab counter tops and electrical switchboards. It is also an important filler material for paints, rubber and insecticides. Even with all these uses, most people only know talc as the primary ingredient in talcum powder.- http://www.galleries.com/Talc','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/talc');
INSERT INTO CommodityType VALUES('tantalum','20500.0','1640.0','820.0','160.0','t','tantalum','Tantalum is a chemical element with the symbol Ta and atomic number 73. Previously known as tantalium, its name comes from Tantalus, a character from Greek mythology. Tantalum is a rare, hard, blue-gray, lustrous transition metal that is highly corrosion-resistant. It is part of the refractory metals group, which are widely used as minor components in alloys. The chemical inertness of tantalum makes it a valuable substance for laboratory equipment and a substitute for platinum. - http://en.wikipedia.org/wiki/Tantalum','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/tantalum');
INSERT INTO CommodityType VALUES('tantalumPentoxide','25000.0','2000.0','1000.0','200.0','t','tantalum pentoxide','An oxide of tantalum also known as tantalum(V) oxide, a white, inert solid with a high refractive index and low absorption (i.e. colourless), useful for coatings, and used in the production of capacitors, due to its high dielectric constant. - http://en.wikipedia.org/wiki/Tantalum_pentoxide','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/tantalumPentoxide');
INSERT INTO CommodityType VALUES('tanzanite','10.0','5.0','0.5','0.1','t','tanzanite','Tanzanite is the blue/purple variety of the mineral zoisite belonging to the epidote group.-  http://en.wikipedia.org/wiki/Tanzanite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/tanzanite');
INSERT INTO CommodityType VALUES('tarSand',null,null,null,null,null,'tar sand','Medium-grained sedimentary rock, yielding significant quantities of tar or oil upon decomposition by heating to high temperatures','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/tarSand');
INSERT INTO CommodityType VALUES('tellurium','500.0','100.0','20.0','5.0','t','tellurium','Tellurium is a chemical element with symbol Te and atomic number 52. A brittle, mildly toxic, rare, silver-white metalloid which looks similar to tin, tellurium is chemically related to selenium and sulfur. It is occasionally found in native form, as elemental crystals. - http://en.wikipedia.org/wiki/Tellurium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/tellurium');
INSERT INTO CommodityType VALUES('terbium',null,null,null,null,null,'terbium','Terbium is a chemical element with the symbol Tb and atomic number 65. It is a silvery-white rare earth metal that is malleable, ductile and very hard. Terbium is never found in nature as a free element, but it is contained in many minerals, including cerite, gadolinite, monazite, xenotime and euxenite. - Terbium is a chemical element with the symbol Tb and atomic number 65. It is a silvery-white rare earth metal that is malleable, ductile and very hard. Terbium is never found in nature as a free element, but it is contained in many minerals, including cerite, gadolinite, monazite, xenotime and euxenite.','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/terbium');
INSERT INTO CommodityType VALUES('thallium','5000.0','500.0','50.0','5.0','t','thallium','Thallium is a chemical element with symbol Tl and atomic number 81. This soft gray other metal is not found free in nature. When isolated, it resembles tin, but discolors when exposed to air. - http://en.wikipedia.org/wiki/Thallium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/thallium');
INSERT INTO CommodityType VALUES('thenardite',null,null,null,null,null,'thenardite','Thenardite is one of several non-marine evaporite Sulfate Class minerals. It is easily dissolvable in water and specimens should be stored with desiccant. Sulfates in general tend to be more soluble than most of the other mineral classes and simple sodium salts, such as thernardite, are always soluble. - http://www.galleries.com/Thenardite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/thenardite');
INSERT INTO CommodityType VALUES('thorium','100000.0','10000.0','1000.0','100.0','t','thorium','Thorium is a naturally occurring radioactive chemical element with the symbol Th and atomic number 90.  - http://en.wikipedia.org/wiki/Thorium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/thorium');
INSERT INTO CommodityType VALUES('thulium',null,null,null,null,null,'thulium','Thulium is a chemical element that has the symbol Tm and atomic number 69. It is the thirteenth and antepenultimate element in the lanthanide series - http://en.wikipedia.org/wiki/Thulium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/thulium');
INSERT INTO CommodityType VALUES('tin','200000.0','25000.0','1000.0','100.0','t','tin','Tin is a chemical element with symbol Sn (for Latin: stannum) and atomic number 50. It is a main group metal in group 14 of the periodic table. Tin shows chemical similarity to both neighboring group-14 elements, germanium and lead. - http://en.wikipedia.org/wiki/Tin','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/tin');
INSERT INTO CommodityType VALUES('titanium','12000000.0','1200000.0','120000.0','12000.0','t','titanium','Titanium is a chemical element with the symbol Ti and atomic number 22. It is a lustrous transition metal with a silver color, low density and high strength. It is highly resistant to corrosion in sea water, aqua regia and chlorine. - http://en.wikipedia.org/wiki/Titanium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/titanium');
INSERT INTO CommodityType VALUES('topaz','10.0','5.0','0.5','0.1','t','topaz','Topaz is a common gemstone that has been used for centuries in jewelry. Topaz is the hardest silicate mineral and one of the hardest minerals in nature. - http://www.galleries.com/Topaz','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/topaz');
INSERT INTO CommodityType VALUES('tourmaline','10.0','5.0','0.5','0.1','t','tourmaline','Tourmaline is a crystal boron silicate mineral compounded with elements such as aluminium, iron, magnesium, sodium, lithium, or potassium. Tourmaline is classified as a semi-precious stone and the gemstone comes in a wide variety of colors. -  http://en.wikipedia.org/wiki/Tourmaline','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/tourmaline');
INSERT INTO CommodityType VALUES('TREE','15000000.0','1500000.0','150000.0','15000.0','t','Total Rare Earth Element','As defined by IUPAC, a rare earth element (REE) or rare earth metal is one of a set of seventeen chemical elements in the periodic table, specifically the fifteen lanthanides plus scandium and yttrium. Scandium and yttrium are considered rare earth elements because they tend to occur in the same ore deposits as the lanthanides and exhibit similar chemical properties. - http://en.wikipedia.org/wiki/Rare_earth_element','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/TREE');
INSERT INTO CommodityType VALUES('tremoliteActinolite','10000000.0','1000000.0','100000.0','10000.0','ct','tremolite-actinolite','Tremolite is a member of the amphibole group of silicate minerals with composition: Ca2(Mg5.0-4.5Fe2+0.0-0.5)Si8O22(OH)2. Tremolite forms by metamorphism of sediments rich in dolomite and quartz. Tremolite forms a series with actinolite and ferro-actinolite. Pure magnesium tremolite is creamy white, but the color grades to dark green with increasing iron content. It has a hardness on Mohs scale of 5 to 6. Nephrite, one of the two minerals of the gemstone jade, is a green variety of tremolite - http://en.wikipedia.org/wiki/Tremolite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/tremoliteActinolite');
INSERT INTO CommodityType VALUES('TREO','1000000.0','100000.0','10000.0','1000.0','t','Total Rare Earth Oxide','As defined by IUPAC, a rare earth element (REE) or rare earth metal is one of a set of seventeen chemical elements in the periodic table, specifically the fifteen lanthanides plus scandium and yttrium.[2] Scandium and yttrium are considered rare earth elements because they tend to occur in the same ore deposits as the lanthanides and exhibit similar chemical properties. - http://en.wikipedia.org/wiki/Rare_earth_element','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/TREO');
INSERT INTO CommodityType VALUES('tsavorite','10000000.0','1000000.0','100000.0','10000.0','ct','tsavorite','Tsavorite or tsavolite is a variety of the garnet group species grossular, a calcium-aluminium garnet with the formula Ca3Al2Si3O12 - http://en.wikipedia.org/wiki/Tsavorite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/tsavorite');
INSERT INTO CommodityType VALUES('tungsten','159000.0','39600.0','4000.0','400.0','t','tungsten','Tungsten, also known as wolfram, is a chemical element with the chemical symbol W and atomic number 74. The word tungsten comes from the Swedish language tung sten directly translatable to heavy stone, - http://en.wikipedia.org/wiki/Tungsten','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/tungsten');
INSERT INTO CommodityType VALUES('turquoise','10.0','5.0','0.5','0.1','t','turquoise','Turquoise is a valuable mineral and is possibly the most valuable, non-transparent, non-metal mineral in the jewelry trade. - http://www.galleries.com/Turquoise','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/turquoise');
INSERT INTO CommodityType VALUES('uranium','100000.0','20000.0','5000.0','500.0','t','uranium','Uranium is a silvery-white metallic chemical element in the actinide series of the periodic table, with symbol U and atomic number 92. A uranium atom has 92 protons and 92 electrons, of which 6 are valence electrons. Uranium is weakly radioactive because all its isotopes are unstable (with half-lives of the 6 naturally known isotopes, U-233 - U-238, varying between 69 years and 4½ billion years).  - http://en.wikipedia.org/wiki/Uranium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/uranium');
INSERT INTO CommodityType VALUES('uraniumOxide','117900.0','23600.0','5900.0','59.0','t','uranium oxide','Uranium dioxide or uranium(IV) oxide (UO2), also known as urania or uranous oxide, is an oxide of uranium, and is a black, radioactive, crystalline powder that naturally occurs in the mineral uraninite. It is used in nuclear fuel rods in nuclear reactors. A mixture of uranium and plutonium dioxides is used as MOX fuel. Prior to 1960 it was used as yellow and black color in ceramic glazes and glass. - http://en.wikipedia.org/wiki/Uranium_dioxide','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/uraniumOxide');
INSERT INTO CommodityType VALUES('vanadium','2000000.0','200000.0','20000.0','2000.0','t','vanadium','Vanadium is a chemical element with the symbol V and atomic number 23. It is a hard, silvery gray, ductile and malleable transition metal. The element is found only in chemically combined form in nature, but once isolated artificially. - http://en.wikipedia.org/wiki/Vanadium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/vanadium');
INSERT INTO CommodityType VALUES('vanadiumPentoxide','3570000.0','3570000.0','35700.0','3570.0','t','vanadium pentoxide','A brown/yellow solid, although when freshly precipitated from aqueous solution, its colour is deep orange. Also known as vanadium(V) oxide or vanadia. Because of its high oxidation state, is both an amphoteric oxide and an oxidizing agent, used as a precursor to alloys of vanadium and as an industrial catalyst. - http://en.wikipedia.org/wiki/Vanadium(V)_oxide','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/vanadiumPentoxide');
INSERT INTO CommodityType VALUES('variscite',null,null,null,null,null,'variscite','Variscite is a relatively rare phosphate mineral that is sometimes confused with turquoise. It is usually greener, however, than turquoise. Variscite is sometimes used as a semi-precious stone and can make distinctive color patterns that are very attractive. - http://www.galleries.com/Variscite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/variscite');
INSERT INTO CommodityType VALUES('vermiculite','10000000.0','1000000.0','100000.0','10000.0','t','vermiculite','Vermiculite is an important member of the Montmorillonite/Smectite Group, members of which also belong to the larger general group known as the Clays. Vermiculite is also sometimes placed in the Mica Group, although recent analysis has excluded it from this group. - http://www.galleries.com/Vermiculite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/vermiculite');
INSERT INTO CommodityType VALUES('vesuvianite','10000000.0','1000000.0','100000.0','10000.0','ct','vesuvianite','Vesuvianite, also known as Idocrase, is a fascinating mineral found originally on the volcano, Mt Vesuvius, hence one of the names. The other name, idocrase, is from the greek and means mixed form, an allusion to its crystals showing a mixture of other mineral forms. - http://www.galleries.com/Vesuvianite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/vesuvianite');
INSERT INTO CommodityType VALUES('whiteFiringClay','5000000.0','1000000.0','200000.0','50000.0','t','white-firing clay','A clay that imparts whiteness to the finished ceramic ware when fired. - http://www.britannica.com/EBchecked/topic/642810/whiteware','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/whiteFiringClay');
INSERT INTO CommodityType VALUES('wollastonite','5000000.0','500000.0','50000.0','5000.0','t','wollastonite','Wollastonite is a calcium inosilicate mineral (CaSiO3) that may contain small amounts of iron, magnesium, and manganese substituting for calcium. It is usually white. It forms when impure limestone or dolostone is subjected to high temperature and pressure sometimes in the presence of silica-bearing fluids as in skarns or contact metamorphic rocks. Associated minerals include garnets, vesuvianite, diopside, tremolite, epidote, plagioclase feldspar, pyroxene and calcite. It is named after the English chemist and mineralogist William Hyde Wollaston (1766–1828). - http://en.wikipedia.org/wiki/Wollastonite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/wollastonite');
INSERT INTO CommodityType VALUES('xenotimeGemstone',null,null,null,null,null,'xenotime-gemstone','Xenotime is a rare earth phosphate mineral, whose major component is yttrium orthophosphate (YPO4). Occasionally, gemstones are also cut from the finer xenotime crystals. - http://en.wikipedia.org/wiki/Xenotime','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/xenotimeGemstone');
INSERT INTO CommodityType VALUES('ytterbium',null,null,null,null,null,'ytterbium','Ytterbium is a chemical element with symbol Yb and atomic number 70. It is the fourteenth and penultimate element in the lanthanide series, or last element in the f-block, which is the basis of the relative stability of the +2 oxidation state. - http://en.wikipedia.org/wiki/Ytterbium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/ytterbium');
INSERT INTO CommodityType VALUES('yttrium',null,null,null,null,null,'yttrium','Yttrium is a chemical element with symbol Y and atomic number 39. It is a silvery-metallic transition metal chemically similar to the lanthanides and it has often been classified as a "rare earth element. - http://en.wikipedia.org/wiki/Yttrium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/yttrium');
INSERT INTO CommodityType VALUES('zeolite','1000000.0','200000.0','50000.0','10000.0','t','zeolite','Zeolites are microporous, aluminosilicate minerals commonly used as commercial adsorbents and catalysts.[1] The term zeolite was originally coined in 1756 by Swedish mineralogist Axel Fredrik Cronstedt, who observed that upon rapidly heating the material stilbite, it produced large amounts of steam from water that had been adsorbed by the material. Based on this, he called the material zeolite, from the Greek ζέω (zéō), meaning "to boil" and λίθος (líthos), meaning "stone. - http://en.wikipedia.org/wiki/Zeolite','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/zeolite');
INSERT INTO CommodityType VALUES('zinc','10000000.0','1000000.0','100000.0','10000.0','t','zinc','Zinc is a metallic chemical element; it has the symbol Zn and atomic number 30. It is the first element of group 12 of the periodic table. In some respects zinc is chemically similar to magnesium: its ion is of similar size and its only common oxidation state is +2. Zinc is the 24th most abundant element in the Earth''s crust and has five stable isotopes - http://en.wikipedia.org/wiki/Zinc','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/zinc');
INSERT INTO CommodityType VALUES('zircon','1000000.0','100000.0','10000.0','1000.0','t','zircon','Zircon (/ˈzɜrkən/; including hyacinth or yellow zircon) is a mineral belonging to the group of nesosilicates. Its chemical name is zirconium silicate and its corresponding chemical formula is ZrSiO4. A common empirical formula showing some of the range of substitution in zircon is (Zr1–y, REEy)(SiO4)1–x(OH)4x–y - http://en.wikipedia.org/wiki/Zircon','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/zircon');
INSERT INTO CommodityType VALUES('zirconGemstone','10.0','5.0','0.5','0.1','t','zircon-gemstone','Zircon resembles diamond in luster and fire and colorless zircons have been mistaken for diamonds by experienced jewelers. Zircon can make a very attractive and affordable gemstone. It is found in browns and greens but can be heat treated to beautiful blue and golden colors. - http://www.galleries.com/Zircon','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/zirconGemstone');
INSERT INTO CommodityType VALUES('zirconia',null,null,null,null,null,'zirconia','A white crystalline oxide of zirconium. Used in the production of ceramics, as a protective coating on particles of titanium dioxide pigments, as a refractory material, in insulation, abrasives and enamels, in oxygen sensors and fuel cell membranes, and as the solid electrolyte in electrochromic devices. - http://en.wikipedia.org/wiki/Zirconia','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/zirconia');
INSERT INTO CommodityType VALUES('zirconium','740000.0','74000.0','7400.0','740.0','t','zirconium','Zirconium is a chemical element with the symbol Zr, atomic number 40 and atomic mass of 91.224. The name of zirconium is taken from the mineral zircon, the most important source of zirconium. - http://en.wikipedia.org/wiki/Zirconium','http://inspire.ec.europa.eu/codelist/CommodityCodeValue/zirconium');
