














/*
*/


UPDATE countrytype c
SET geometry = n.geom
FROM public."nutsAll" n
WHERE c.country = n.nuts_id
;

UPDATE provincetype p
SET geometry = n.geom
FROM public."nutsAll" n
WHERE p.province = n.nuts_id
;

UPDATE regiontype r
SET geometry = n.geom
FROM public."nutsAll" n
WHERE r.region = n.nuts_id
;


